rs, nostalgia for icons from the 90s, and kid themes","Kid Science is the aesthetic surrounding educational efforts to make science appealing to children through presenting the field as fun, with kooky characters, bright colors, highly stylized images, and doable experiments. Unfortunately, many of the efforts into kid science are marketed towards boys, but the subject is gender-neutral.It emphasizes all fields, but paleontology, zoology, entomology, and astronomy are the most popular subjects"," A often mentioned inspiration for the style are the musicians Kim Shattuck of the band The Muffs, Christine Amphlett of the band Divinyls or Katie Jane Garside of the band Daisy Chainsaw. It is believed that Kat Bjelland from the band Babes in Toyland was the first to wear and define the look, while her former roommate Courtney Love from the band HOLE was the first to popularize it.Courtney Love, who popularized kinderwhore, commented in 1994 that 'I would like to think\u2014in my heart of hearts\u2014that I'm changing some psychosexual aspects of rock music","Those who adopt a Kingcore aesthetic may be seen as the leader of a group. Kingcore is a variant of Royalcore that revolves around the imagery and power of portrayed kings in history, folklore, and fictional work","There is also a portion of the aesthetic community that related Knightcore to Rangercore, using the shared themes of combat and nature visuals. Like the related aesthetic Princecore, a section of this aesthetic is centered around gay relationships and the two are often paired together","Kogal (also known as Kogyaru) is one of the many substyles of Gyaru fashion. It is also the originator of several modern gyaru styles.It is one of the most popular substyles of Gyaru, and as well as being a fashion style,it became a cultural movement within Japanese youth","Kuromicore is an aesthetic based on the character Kuromi, who is a white rabbit wearing a devil-inspired attire, by the company Sanrio (see also: Sanrioc ily draw from to Vaporwave, Anime, Cartooncore, Spiritcore and Vintage. Lo-Fi is a largely music-centric aesthetic that utilizes muted tones and mundane imagery to evoke a feeling of calm and nostalgia","Many Lolitas suspect that a writer decided the Spanish name Lolita complemented the feminine and whimsical fashion and it just caught on. Lolita dresses are categorized as either JSKs or OPs","","Lovecore tends to focus on the commercialization of love through Valentine's Day and marketing as well as wholesome celebration of love rather than the dark, macabre or erotic. There is sometimes overlap with anime in the form of pink manga edits and images of anime characters with hearts in their eyes.As the aesthetic became more intense and anime-centric, a subcategory of lovecore called Yandere appeared","Luminism preceded impressionism, and the artists who painted in a luminist style were in no way influenced by Impressionism.As defined by art historian Barbara Novak, luminist artworks tend to stress the horizontal, and demonstrate the artist's close control of structure, tone, and light. It is characterized by effects of light in the landscape, through the use of aerial perspective and the concealment of visible brushstrokes","\"Punk\" intends to reference both the futuristic setting of a Lunarpunk society as well as the struggle against a more suspicious, mysterious government/overruling power. Visuals of the aesthetic are borrowed from pagan, satanic, Wiccan, or anarchist references, and the architecture is a mixture of futuristic shapes as well as mushroom-inspired, luminescent, nature-based designs","Trigger warning: This article is not recommended for those sensitive to blood, guts, and other forms of violence","This page is under constructionMad Scientist is a fictional trope that revolves around a scientist who uses their knowledge for evil or utilizes villainy to support their research. Because of the different homages, references, and practical writing necessities in media featuring these characters, the trope has a consistent visual aesthetic","Magenta is one of the primary colors in the RGB color model. It, like most colors, can tie into multiple aesthetics","Magewave is an aesthetic associated with the classic ideal of the wizard. It shouldn't be confused with Wizardcore or Witchcore, as it rejects the muted imagery and Cottagecore stylings associated with those aesthetics","Unlike its original subculture which had its origins in Gothic Rock, Mall goths could often be found listening to Nu-Metal, Industrial Metal and Marilyn Manson.\"Mall goth\" is derived from the words \"mall\" and \"goth\", referencing how many participants of the subculture would often spend time at shopping malls. Mall goths (also known colloquially as \"spooky kids\"), originally a term used as an insult, is a term used to describe a subculture (subculture used very debatably here) of \"wannabe Goths\" in the '90s-early 2000s who would try to imitate the goth style without actually knowing anything about the goth subculture beyond wanting to look the part","In fact, one of the main motivators of becoming a mall ninja could come from wanting to be like an anime character or because of the Dunning-Kreuger Effect; a Weeaboo may mistake the hours of anime they watched as weapons training. Mall Ninja is a set of stereotypes about men who claim to be badass and have an interest in weapons, anime, and action movies"," Despite the subculture dating back over 100 years, the term is still used in Greece today the way English-speakers may use the term \"dude\". Not to be confused with the medium.Mangas is a term used to described working-class boys in Greece during the Belle \u00c9poque era of French/Western history (roughly from 1871 up until the beginning of World War 1 in 1914) who behave in an incredibly arrogant manner","This page needs work.Maternity is the period during pregnancy and shortly after childbirth","McBling is an aesthetic that was popular from roughly 2003 to 2008, succeeding the Y2K aesthetic. It was coined through a Facebook page in 2016 made by Evan Collins of the Y2K Aesthetics Institute","This aesthetic does not aim to romanticize, fetishize, or glorify illness or medical-related trauma but aims to act as a coping mechanism for those in need of it. If these sort of things bother you please leave this page.Medicalcore is an aesthetic that involves paraphernalia and the appearance of all things medical-related","The Medieval period, also called The Middle Ages, is an era that lasted from the fall of the Roman Empire to the start of the Renaissance, which occurred from approximately the 5th century to the 15th century. Between this time, there were multiple advancements in art and architecture, but due to popular perception of the era, recurring motifs, and difficulties in periodization, this page will encompass a survey of the entire artistic history","This aesthetic is often used to retroactively define and depict the decade it debuted in. Although the look for this aesthetic was used for furniture, it's also used in visual art as well","Heavy Metal was the culmination of the Acid rock heard in the late 1960s - a genre that describes the heavier sounding Psychedelic rock first played by various bands of the San Francisco music scene. Metal is a term that encompasses a style of heavy, aggressive music","Metalcore (or metallic hardcore) is a fusion music genre that combines elements of extreme metal and hardcore punk together. Among other styles blending metal and hardcore, such as crust punk and grindcore, metalcore is noted for its use of breakdowns, which are slow, intense passages conducive to moshing","This term was coined in 1994, and is typically used to refer to a man living in an urban, post-industrial, consumerist culture. Metrosexual is a term used to refer to a man that makes sure that he looks good, and tends to spend a lot of time and money doing so","","","The Midwest is city, town, forest, and cornfield, Expect Detroit, that place is Midwest Gothic in a city. Midwest Gothic is a type of Regional Gothic aesthetic characterized by the portrayal of common facets of the Midwestern American lifestyle in a macabre light","The Military aesthetic is based on war and other aspects of military life","Viewer discretion is advised.Milleniwave is an aesthetic born from an overall sense of Millennial frustration and existential dread with the direction society is going by trying to put a happy face and a bright, colorful facade over it that does a piss-poor job of actually hiding it. Warning: Milleniwave visuals do have the potential to trigger seizures due to flashing, bright, and/or obnoxious colors and lights","Milk aesthetic can also apply to milk tea, and others things with similar flavours. The Milk aesthetic is largely revolved round the look of everyday milk cartons and bottles, mainly focusing on color and minimalistic styling of containers","It has had a widespread influence, ranging from the arts to lifestyle.As an art movement, minimalism began in post-WWII Western art, and was most prominent in the 1960s through the early 1970s. Minimalism refers to a lack of clutter or unnecessary detail","Elements of the mod subculture include fashion (often tailor-made suits); music (including soul, rhythm and blues, ska, jazz, and freakbeat); and motor scooters (usually Lambretta or Vespa). Focused on music and fashion, the subculture has its roots in a small group of stylish London-based young men in the late 1950s who were termed modernists because they listened to modern jazz","People started to feel like ideologies (religious and moral) and culture were falling apart, which went against Enlightenment ideals; Modernism embraced this fragmentation of culture. This led to Postmodernism.Modernism was a rejection of tradition and the Enlightenment values that had once consumed Europe","","The aesthetic is one that has largely fallen out of popularity due to the current notoriety of Traumacore, the insular community, mental recovery of many influencers, and discourse surrounding the aestheticization of dark themes. This is a page that will be part of a series on more anthropological approaches with interviews and noted influencers.Trigger warning: This article has a focus on topics of abuse, mental illness, eating disorders, and religious abuse","The idea is to attract the widest possible interest from men. Mote kei is a Japanese fashion trend that shows femininity without showing off with sexual appeal or individuality","Mosscore is an aesthetic that focuses on forest and moss related things and objects. This aesthetic is closely related to other forest-themed aesthetics like Forestpunk, Cottagecore, and Mushroomcore","The visual of the aesthetic applied to digital drawings of a lowish quality or made with tools the program of the same name has. MS Paint is a subgenre of old web","Mushroomcore is the aesthetic of mushrooms. Mushrooms are often associated with the underworld, this is due to the fact that mushrooms decompose dead matter and are linked to the rebirth and recycling of dead matter","Musical Academia is not strictly adherent to school curriculum, as self-teaching may be just as effective and valid within the aesthetic. Musical Academia is an aesthetic involving the art and education of music theory, culture, creation, and learning instruments and vocal techniques","Nanopunk is an aesthetic that is heavily inspired by Biopunk and Cyberpunk, and focuses on the impacts of nanotechnology","Although social sciences are emphasized less in green academia than in other academic aesthetics, philosophy, natural history, and environmental sociology are featured in various forms throughout green academia media. It could be argued that green academia is similar to goblincore in its love of nature, collecting trinkets, and fashion, but green academia is more intellectual and scientific","Naturecore is an aesthetic surrounding the theme of animals and other nature related things (ie","Nautical is an aesthetic centered around sailing and living near the sea","Due to the role the Nazi Party played in history and the subsequent sensitive and offensive nature of this aesthetic, it is not recommended that you adopt it for yourself. Aesthetics Wiki does not endorse Nazi ideology - but it is important to acknowledge its impact on modern culture.''Nazi Chic is an aesthetic centered around the use of Nazi-era style, imagery, and paraphernalia in clothing and popular culture, especially when used for taboo-breaking or shock value rather than out of genuine sympathies with Nazism or Nazi ideology, although it can be used as a tool to critique elements of contemporary society by drawing allusions to the Nazi Party and their laundry list of evils they committed.A popular use of the Nazi Chic aesthetic occured in the mid-1970s with the emergence of the Punk movement in London: the Sex Pistols' first television appearance occurred with a person of their entourage wearing a swastika","Neko is an aesthetic related to the cat-people (most notably catgirls, and rarely catboys) trope in anime and manga. The charm of the Neko aesthetic is its exaggerated childlike femininity","","wearing glasses, a bowtie, overalls, high socks, slacks, and/or braces). The term \"nerd\" originated in the 1950s from a Dr","Trigger warning: This aesthetic revolves around things of a sexually explicit nature such as hentai, sex talk, and vulgar music lyrics (including the N-slur). Also, drug talk will be mentioned","New Age is an aesthetic intended to create artistic inspiration, relaxation, and optimism. It is used by listeners for yoga, massage, meditation, reading as a method of stress management to bring about a state of ecstasy rather than trance, or to create a peaceful atmosphere in their home or other environments, and is associated with environmentalism and New Age spirituality","The New Romantic movement was characterized by flamboyant, eccentric fashion inspired by fashion boutiques such as Kahn and Bell in Birmingham and PX in London. The movement emerged from the nightclub scene in London and Birmingham at venues such as Billy's and The Blitz","Neo-Romanism is an aesthetic influenced by Bronzepunk, Sandalpunk, Neoclassicism, Futurism and Renaissance, among others. Neo-Romanism began to boom with the popularization of neo-pagan religions such as Hellenism and the Roman Way at the end of the 20th Century, which have influenced its \"romantic\" vision of those times","The term derived from the unrelated \"French New Wave\" and was originally used as a catch-all for the music that emerged after Punk Rock, including punk itself, but may be viewed retrospectively as a less challenging counterpart of Post-Punk. Although new wave shared punk's DIY-philosophy, the artists were more influenced by the lighter strains of 1960s pop while opposed to mainstream \"Corporate\" rock, which they considered creatively stagnant, and the generally abrasive and political bents of punk rock","Nintencore is an aesthetic based around Nintendo. Nintencore is also used but not limited to mostly with nostalgic and happy things","\"Normcore\" is a portmanteau of the words \"normal\" and \"hardcore\". The word first appeared in webcomic Templar, Arizona before 2009 and was later employed by K-Hole, a trend forecasting group, in an October 2013 report called \"Youth Mode: A Report on Freedom\".As used by K-Hole, \"normcore\" refers to an attitude, not a particular code of dress"," Some members of white nationalist movements have attempted to co-opt these symbols to promote their own hateful ideology, but the Northerness aesthetic has absolutely no interest in promoting a white nationalist ideology and would instead like to reclaim those symbols as sacred to the Nordic people as opposed to something used to promote hate (especially considering, for their time, the Viking people were actually an incredibly progressive society). Northerness is an aesthetic related to Nordic/Scandinavian areas of the world","Nostalgiacore is an aesthetic involving nostalgia and archived internet history","This page needs work.Nowpunk is a term invented by Bruce Sterling, which he applied to contemporary fiction set in the time period (particularly in the post-Cold War 1990s to the present) in which the fiction is being published, i.e","Nozem was a term to describe self-conscient, rebellious youth, often aggressive and considered problematic by authorities in the Netherlands","Nuclear is an aesthetic that is based around the themes of nuclear power, nuclear weaponry, machines and more. It involves gas masks, hazardous items, hazmat suits, and lands in ruins","Nu Goth is a modern take on goth subculture that is heavily rooted and influenced by traditional gothic music, aesthetic and philosophy. Its followers are deeply philosophical by nature and have a great interest in studying the human condition often through psychology, philosophy, and the occult","It's still necessary to acknowledge even harmful influences on modern visual culture, but we at the Aesthetics Wiki DO NOT condone the romanticization of pedophilia and child abuse. As an aesthetic, this word refers to the style of Dolores Haze in the movies, that influences the fashion nowadays","This involves specializations such as oceanography, marine biology, marine archaeology, ocean engineering, hydrology, naval architecture, etc.This aesthetic mainly centers around one's passion for learning about the deep ocean, sea mythology, marine life, and mysteries of the abyss. Ocean Academia is an Academia aesthetic that revolves around the fascination, dark understanding, and scientific pursuit of marine education","Ocean Grunge is a music-centric aesthetic that is considered the darker version of Seapunk that started in 2014. The music itself takes a lot of inspiration from early Vaporwave, drone, Nu-Metal, and Grunge, and does have some similarities to Witch House, but while Witch House has more of a spooky and ethereal air to it, Ocean Grunge tends to be hollow and depressing but still carries the ocean/sea motif its cousin genre carries","\t\t \t  \t \t \t \t\t \t\t \t\t \t\t\tA longer hairstyle. \t\t \t  \t \t \t \t\t \t\t \t\t \t\t\tA classic hair-do","Essentially consisting of screencaps and gifs, Old Web is an aesthetic utilizing traditional web design elements combined with aspects of poetry and self-expression. This aesthetic expresses nostalgia for Internet culture of the mid-1990s to late 2000s (spanning roughly Windows 95 to the glory days of YouTube).Old Web's philosophical heart yearns for the days of uninhibited individualism of the old web, before the internet became streamlined and social media monopolized how people communicated, and web graphic design developed a stricter set of rules for the \"dos\" and \"don'ts\" for the sake of accessibility and marketing.Many Old Web screencaps and gifs come from archived Geocities websites made by amateur coders and animators","Oshare Kei (\u304a\u6d12\u843d\u7cfb) is the opposite side of Visual Kei with bright colors and many pop impressions. Thus said, bands under this style live up to the meaning by dressing up in colorful costumes, or in Decora or Pop Kei style","'kin can't have fun with their identities, nor that people shouldn't voluntarily take on an identity for any reason, though it's good to be aware of this distinction and the possible spread of misinformation.There are a few different ways in which 'kin/related identities can develop. While neither of these things are bad on their own, the misuse of otherkin terms has harmed the community through misunderstandings, and the devaluing of spiritual/psychological 'kin's experiences.There is an important distinction to be made between spiritual/psych","Pale or Pale Aesthetic is an aesthetic based on simple photos with a color palette based on white, grey, black, green, and blue. The type of media they consumed was also incredibly specific, with fangirl culture and this aesthetic often overlapping","Palewave is a very popular aesthetic that typically starts to gain more and more traction as summer starts to hit. Palewave centers around muted and pale colors with a very relaxed and comfy vibe","Paleocore values learning and information as well as cool dinos.Paleocore is similar to Dinocore based on the fact that they both focus on dinosaurs and prehistoric themes. Paleocore is an aesthetic that revolves around paleontology and dinosaurs","DISCLAIMER: SOME OF THE ACTIVITES NAMED IN THE ACTIVITY SECTION SHOULD BE PRACTICED AT YOUR OWN RISK. \t \t \t \t\t \t\t\t \t\t \t\t \t\t \t Party Animal is an aesthetic revolved around parties and having fun","Party Kei is a fashion style developed in the mid-2010s by Canadian YouTuber Jillian Vessey/Pixielocks, modelled after Japanese street fashion. However, the style mutated in the years to follow: Vessey and her fanbase, the 'Confetti Club', now wear louder garments from Western brands such as Lazy Oaf, with party references becoming more overt and rainbows used as a common theme.Since Vessey is neither Japanese nor a fluent speaker of the language, there is controversy over her use of the Japanese 'Kei' suffix, usually attached to styles hailing from the specific Harajuku locale, to describe a fashion now made up of mostly Western brands","Pastel is an aesthetic that relates to pastel colors. The pastel colors can be created by adding white, and the more white adding into the original shade, the paler the pastel will be","Pastel Academia is one of the many variations of the Academia aesthetic and subculture. Someone who is a part of the Pastel Academia aesthetic is less mature and more child-like than those who identify with the other versions of academia","Pastel Goth (not to be confused with Gurokawa or Nu-Goth) is a fashion that first emerged from groups on VK.com and later spread to Tumblr in the early 2010. It is a result of mixing goth or grunge with the sweet pastel elements of the kawaii aesthetic, but also a touch of bohemian chic","","The aesthetic is similar to Softie, but, unlike it, doesn't have a wide variety of possible colour palettes and focuses on peaches instead of gentleness. Peach is an aesthetic that revolves around things that are considered peachy, the fruit of the same name or the colour","It can also be paired with Crystalcore as it pertains to some jewelry worn within the Pearly aesthetic. A sort of heavenly vibe is also incorporated","There is heavy emphasis on creating connections between certain imagery and motifs through creating moodboards and compilations/parallels/web-weaving (explained below). The community surrounding that aesthetic stems from a shared admiration for poetry, quotes from literature, music, and artworks that are circulated via reblogs on tumblr","","Photorealism is a genre of art that encompasses painting, drawing, and other graphic media","Themed around softer aspects of hoarding, collecting, cooking, and other goblincore essentials, focuses on the softer curiosity rather than the goblin-ey nature. Pigeoncore is an aesthetic surrounding the theme or hoarding and nature but includes that of birds (most notably, pigeons)","Pink is an arbitrary classification of colors consisting of light to mid-range variations of magenta, rose, red and sometimes orange (mostly rose and red).It was named after the flower of the same name","Female models are also called Cheesecake models, while men are called Beefcake models. Pin-up models would be photographed in anything from scantily clad clothing to being in the nude","It usually involves boats, the sea, and treasure rather than actual crime.It draws its inspiration from aesthetics such as Adventurecore and Crowcore, and may include things such as: collecting shells/rocks/trinkets/bones/etc, studying maps and constellations, sea travel, and sketching. The community around this aesthetic instead value freedom, fairness, curiosity and balance","Sometimes it can also associate with 8-bit clouds and sunsets, but not always. Pixel Cutie is an aesthetic based on a fascination of pixel art and games, usually involving cute, light colors like (but not limited to) Pink, Lilac, Light Blue, Soft Orange, etc.","Pixiecore is very loving of nature, but focuses more on indoor gardening such as succulents, cacti and terrariums.In folklore, pixies love to play in water, and as such, pixiecore also focuses on things such as bathing in baths filled with things such as bubbles, soap petals and bath bombs.Similar to Crowcore and Goblincore, Pixiecore involves the culture of collecting things from the floor and keeping them. Pixiecore also focuses on rainbow tones, anything holographic, iridescent, or rainbow coloured can be involved in the aesthetic","Plaguecore is an aesthetic about plague doctors. But if you upset them they will be sure to mess up your humors.The aesthetic revolves around mostly black and grays, leeches, bloodletting, lavender, cloaks, bird masks, and dark humor","The same goes for the accounts that they have. Plant Mom is centered around having plants and plant-related accessories","Not to be confused with the Playboy brand, often associated with the Bad Bitch aesthetic.The Playboy aesthetic revolves around the aesthetics of the jet-setting playboy lifestyle. It could be viewed as a Brocore colored variant on the Boujee aesthetic with it's own unique tone and spin on things","Pointillism is a technique of painting in which small, distinct dots of color are applied in patterns to form an image","Up until the 60s, the meaning also included rock 'n roll, but afterward came a proper definition and musical consolidation. Pop, also known as popular, is a music genre that originally emerged in the mid-50s in the USA and the UK","Pop art is meant to challenge the idea of what art should be. Pop art is an art movement that emerged in the United Kingdom and the United States","The term refers to how the brightly colored clothing \"pops\" in an outfit. Pop Kei (\u30dd\u30c3\u30d7\u7cfb) is a colorful Japanese fashion mostly associated with the Decora aesthetic","Post-Impressionism is an art movement that developed in the 1890s. Artists tried to create artwork that evoked emotion","Postmodernism is a broad movement that developed in the mid- to late 20th century across philosophy, the arts, architecture, and criticism, marking a departure from modernism","The story may involve attempts to prevent an apocalypse event, deal with the impact and consequences of the event itself, or may be post-apocalyptic, and be set after the event. The apocalypse event may be climatic, such as runaway climate change; natural, such as an impact event; man-made, such as nuclear holocaust; medical, such as a plague or virus, whether natural or man-made; or imaginative, such as zombie apocalypse or alien invasion","Like the American pioneers, this aesthetic finds power in freedom and experimenting with new things by using the old as inspiration. Prairiecore emerged from the American boho aesthetic during the 1970's, as an offshoot of the hippie/ flowerchild movement","The terms are used to denote a person seen as characteristic of a student or alumnus of these schools. Preppy (also spelled Preppie) or Prep (all abbreviations of the word preparatory) is a subculture in the United States that is associated with old private Northeastern university-preparatory schools","A majority of Princecore writing is heavily centered around fictional gay prompts centering relationships between princes and knights, or other princes. Princecore is heavily based on gay relationships","Princesscore is an aesthetic based on the life, fashion, and mannerisms of a princess","Psychedelia refers to psychedelic art, psychedelic music and the subculture that originated in the psychedelic experience of the 1960s, by people who used psychedelic drugs such as LSD, mescaline (found in peyote) and psilocybin (found in magic mushrooms). Psychedelic art and music typically recreate or reflect the experience of altered consciousness"," Punk is an aesthetic and subculture centered around the punk rock movement of 1970s that followed in the footsteps of the Hippie movement. Aesthetics with the \u2018-punk\u2019 suffix generally share an attitude of defiance and/or rejection of mainstream society and, but there are some which are completely unrelated.On the other hand, some people enjoy the visual aspect of 1970s original punk, and reject the philosophy, but most actual punks would refer to these people as posers","Purism refers to an art movement that mainly took place between 1918 and 1925. Led by Am\u00e9d\u00e9e Ozenfant and Charles Edouard Jeanneret (Le Corbusier), Purism was born from criticism of the decorative Cubist movement","The Queencore aesthetic wouldn't be complete without confidence and displays of good leadership.For a darker approach, colors can be toned deeper, and inspiration can be drawn from evil queen characters. Those who adopt a Queencore aesthetic may be seen as the leader of a group","Queer Academia is an aesthetic that focuses on LGBTQ+ history, taking time to learn about the people history books left out and bringing attention to their work"," Queercore media (such as music, zines, and books) effectively opened what can be termed a queer counter-public sphere in opposition to the institutions of the lesbian and/or gay public sphere already in existence and exemplified by organizations like GLAAD and NGLTF, spaces like established middle-class gay neighborhoods, or events like the Michigan Womyn's Music Festival or Gay Pride marches.Curran Nault, in his book Queercore: Queer Punk Media Subculture, describes queercore as \u201ca configuration of artistically minded gender/sexual dissidents who annex punk practices and aesthetics to challenge the oppressions of the mainstream and the lifeless sexual politics and assimilationist tendencies of dominant gay and lesbian society.\u201dQueercore stands against the mainstream gay politics of integration with cishet (cisgender, heterosexual) society and the culture of respectability politics that is common among the majority of people in the LGBTQ+ community. Queercore (also known as homocore), is a cultural and social movement that began in the mid-1980s as an offshoot of the punk subculture","The genre features a distinctive record production style, drum machine-backed rhythms, pitch corrected vocals, and a smooth, lush style of vocal arrangement. R&amp;B, also known as Rhythm and Blues, is a music genre that combines elements of pop, soul, funk, hip hop and electronic music","This term refers to a despicable group, often the poorest part of the population. Racaille (French, originally means \"scum\") are a type of french gangster that wears a Lacoste cap, usually tight jeans or sweatpants","Rainbowcore is an aesthetic that has a focus on rainbows","This aesthetic often appeals to introverted people. Rainy Day is based on rainy weather, as well as stormy or foggy weather","The Rangercore aesthetic is based on the fantasy rangers you see in Ranger's Apprentice, Tolkien books, and Dungeons and Dragons","Ratcore tends to have a \"creepy-cute\" aspect to it. Sometimes Ratcore is portrayed as having a very chaotic aspect to it because of the \"rabidness\" and wilderness of the small animal","Ravencore is a nature-centered aesthetic, taking inspiration from ravens themselves. Ravencore is built around these basic principles.Members of Ravencore often collect rocks, minerals, crystals, moss, candles, bones/skulls, insects, and other natural \"trinkets\"","Raves are an organized dance party at a nightclub, outdoor festival, warehouse, or other private property typically featuring performances by DJs, playing a seamless flow of electronic dance music. DJs at rave events play electronic dance music on vinyl, CDs, and digital audio from a wide variety of genres, including techno, hardcore, house, bassline, dubstep, New Beat, and post-industrial","Real Life Super Hero (often shortened to RLSH) movement is an aesthetic that involves dressing up like comic book character and generally engage in good deeds, where it can range from simple things like visiting sick children in a hospital to simple neighborhood watches to more controversial actions like actual vigilantism which is dangerous.  The aesthetic has a small relation to Kidcore, in the sense that it ties into a child-like notion of justice and wanting to do right","Realists used unprettified detail depicting the existence of ordinary contemporary life, coinciding in the contemporaneous naturalist literature of \u00c9mile Zola, Honor\u00e9 de Balzac, and Gustave Flaubert.Realism is the precise, detailed and accurate representation in art of the visual appearance of scenes and objects. Realists rejected Romanticism, which had dominated French literature and art since the early 19th century","The Reefwave visual aesthetic is essentially a different way of viewing Nautical; instead of focusing what the ocean is like from on land, collecting shells and walking on the beach, Reefwave focuses more on the ocean itself - in particular (but by no means exclusively), on the way water and waves affect the way light falls underwater.   Because much of Reefwave centers around the way light behaves, its aesthetics pop up often in video games, where refraction is a fairly common way to display the power of a game's graphics engine","In the US, this time period is sometimes referred to as the Federalist Era. The formal Regency era lasted from 1811 to 1820 AD, but the period from 1795 to 1837 AD is also sometimes regarded as part of the Regency era","The trend was relatively dormant until March 2015, when tumblr user korvidian created a post entitled \"south-east queensland gothic\" that created the template for all future Regional Gothic lists here on after. Regional Gothic is a tumblr trend in the mid 2010s wherein users would write bullet-pointed lists of eerie moments related to the region in which they grew up in or other seemingly benign moments in life, such as college","Retrofuturism is a movement in the creative arts showing the influence of depictions of the future produced in an earlier era. Characterized by a blend of old-fashioned \"retro styles\" with futuristic technology, retrofuturism explores the themes of tension between past and future, and between the alienating and empowering effects of technology.Retrofuturism can be separated into several genres by the era of technology they were based on","Rivethead refers to people that are fans or performers of industrial music, which is influenced by electro-industrial, electronic body music, and industrial rock music","For the art and architecture movement associated with the era, see Art Deco. The Roaring 20s is the given name to the decade of the 1920s in Western culture","Robotics kids usually flock together with other robotics kids as normal humans view their obsession with any and all things robotics annoying at times. Robotics kids are the high school aged people who compete in a program called First Robotics Competition or something similar","As a genre it blends the sound of Western musical styles such as country with that of rhythm and blues, leading to what is considered \"classic\" rock and roll. Some have also described it as a blend of bluegrass with rock and roll","Rococo, often called late Baroque, was an architectural and artistic style developed in France in the first half of the eighteenth century. Rococo art rejected the dark solemnity of the Baroque aesthetic, while maintaining the ornamentation","Rococopunk is a punk derivative that thrusts punk attitude into the late Baroque period. Rococopunk has most recently been featured on The X Factor through the artist known as Prince Poppycock","The name is a reference to the 1975 James Caan film Rollerball, and like the film, the aesthetic often delves into 1970s retrofuturism, however, unlike standard Retro-Futurism or Atompunk, Rollerwave deals only with the 70s, and has a far less Jetson-y feel. Rollerwave is an aesthetic which does for the 70s what Outrun does for the 80s and Vaporwave does for the 90s","However the concept is interpreted differently depending on the Romani group and what country they live in.The Roma people have a rich culture and have faced racism and discrimination, even to this day. The Roma aesthetic is based on 19th and 20th century Romani population fashion, style and way of life","","Because Romanticism is so idealistic, it often aligns itself with Nationalism which is why the traits and visual tropes of Romanticism vary from country to country. However, this fascination with national ideals often resulted in a Romantic fertilization of non-western/European societies and cultures","Romantic Academia is visually and philosophically similar to Light Academia. However, Romantic Academia includes more visuals associated with romantic love and lust, the latter of which is generally excluded from Light Academia","The participants of this aesthetic place a great importance on appreciation of the arts and the luxurious lives of the Italian nobility, such as in masked balls. Romantic Italian is an aesthetic built upon the romanticism of the culture of Italy, particularly its idyllic countrysides, rich history, fashion culture, and languid society"," Subgenres for royalcore may have page extensions listed below their descriptions.   Royalcore, as of now, mainly focuses on visual characteristics and contexts of historical European monarchies","Work-based means includes a lot of tasks or jobs. It focuses on more simplistic ways of life and it\u2019s heavily work-based","","The Sadpeople aesthetic involves mental space, loneliness, and abandonment. Within the Sadpeople group, there are Sadbois and Sadgirls","This would potentially lead to a less-isolated retro-futurist Greece that was never conquered or a retro-futurist Roman Empire that never fell. Prime examples would be the mechanical wonders in films like Jason and the Argonauts (1963) and Clash of the Titans (1981) or the God of War video game series","Sanriocore is an aesthetic centered around Sanrio Co., Ltd.(\u682a\u5f0f\u4f1a\u793e\u30b5\u30f3\u30ea\u30aa) a Japanese company created by Shintaro Tsuji that sells cute (or Kawaii) Japanese merchandise. Sanrio's most popular icon, Hello Kitty, has become one of the world's best-selling brands","Like many other academic aesthetics, science academia visuals are predominantly inspired by photographs from and paraphernalia prevalent in academic settings during the late 19th and early 20th century.The most popular branches of science presented in visuals and communities are mathematics, physics, chemistry, astronomy, microbiology, and human anatomy and physiology. Science academia visuals vary among disciplines, but they share some common traits","","The word scrapper as defined by Merriam-Webster means fighter, quarreler, and a fierce competitor. This is based off of the word scrap, which, among other things, means to fight","Members of the original Scene subculture were nicknamed Scene kids, Scenesters, or Trendies. Scene is often confused with or used interchangeably with Emo, a subculture that formed from the music genre \"emotive hardcore\"","Scoutcore isn't mainly focused on girl or boy scouts, mostly having fun, camp morals, bunkmates, collecting badges and summer activites. Scoutcore is an aesthetic surrounded by scoutism activities, such as camps and closely related to Campcore","Scuttlers were members of neighborhood-based youth gangs (known as scuttling gangs) formed in working-class areas of Britain in the late 1800s","Seapunk is a music and visual art genre that utilize imagery from the 2000\u2019s Cyberpunk culture, including dolphins, pyramids, bright colors, beach scenes, and dreamscapes. Seapunk was extremely popular in the late 2000s and early 2010s until it started to get mainstream too quickly (being utilized by the likes of Lady Gaga and Katy Perry), culminating in the infamous (to the scene) Rihanna performance on Saturday Night Live of her hit song \"Diamonds\", which co-opted a lot of Seapunk imagery and aesthetics during it","Selkiecore is based around the mythological selkies, seals, Norse and Celtic/norse marine life as well as their environment, including the usual grey cold weather and look of their environment. This is unlike selkiecore, which centers on mythological sea creatures as well as other marine life, their nature and their habitat","","This page needs work.Shamate (Sh\u0101 m\u01ce t\u00e8/\u6740\u9a6c\u7279) is an edgy aesthetic that comes from China","Other than home decor, fans of the look typically have hobbies adjacent to the vintage and feminine aesthetic, such as gardening, baking, sewing, and reading. Shabby Chic is an aesthetic, typically in interior design, that centers around distressed and worn-out appearing furniture from the Victorian era","","Though named in 2017 following a trend found on sites like Tumblr and Instagram, sizz is in fact a more modern evolution of several older aesthetics - a sort of combination of the German expressionist method of abstraction to build a sense of mood, the emotion created by contrast and lighting in American film noir, and the way the Japanese are-bure-bokeh street photography movement embraces griminess and lack of focus in its snapshots. Sizz is a relatively new aesthetic that focuses on noise, distortion and other artifacts as a way to modify the subject of an image and make it more abstract","Similar to Vaporwave and Seapunk, this aesthetic is an integral part of the genre and characterizes the artists who dive into the Slimepunk movement. Slimepunk music often times features heavy &amp; distorted bass-lines and has emerged largely from a post-acid scene","This page needs work.Sloanie, Sloane or Sloane Ranger is a stereotypical young upper-middle or upper class British person who pursues a distinctive fashionable lifestyle. Sometimes these people are referred to as \"Posh\" but it is important to note that not all posh people are Sloanes","Warning: The article mentions sexual themes and content. Slutcore is an aesthetic that combines the vibrant colours and independent femininity of Bubblegum Bitch with explicit and unabashed sexuality, oftentimes in a promiscuous manner","Snailcore is an aesthetic revolving around snails and the things in nature associated with them","","Usually characterized by the decline of technology, abandoned cities full of wildlife. The technology they have might be solar, wind, or other renewable energy sources","Softie is a group of aesthetics dedicated to going for as cutesy of a look as possible, putting it in a trifecta of aesthetics, alongside VSCO and E-People. It draws a lot of parallels with some of the Kawaii-centric aesthetics in Japan, but with a more subdued look compared to how over-the-top some of the looks in Japan tend to get.They are sometimes mistaken for preppies","Soft Macabre is grungy in its visuals, with grains and other messy filters being a key part of the Soft Macabre aesthetic. Soft Macabre is an aesthetic that evokes both creepiness and softness at the same time","Soggy (or Swampcore) is an aesthetic that relates to the theme of swamps, wet outdoors and animals that are found in the dirt, such as worms, frogs, toads, slugs and snails","Solarpunk also emphasizes handcrafted wares (as opposed to mass-produced products) and community. The 'punk' in Solarpunk comes from the genre's anti-authoritarian and anti-capitalist nature, as well as its strong focus on community and prefigurative politics, which separates it from aesthetics like Cyberprep","Southern Gothic is a goth subgenre encompassing fashion inspired by Southern outfits, locations from the 1800s, and literary works. It originated in works by 19th-20th century Southern authors criticizing their society's racism, sexism, classism, fixation on the past, and decaying economy","","Spacecore is a type of aesthetic that is centered around astronomy, stars and planets. Spacecore uses lots of stars and planet type things in clothing or decor","Sparklecore is an aesthetic based on sparkles, shiny objects, and comfort. However, those things are not required to fully live this aesthetic","Spiritcore is an aesthetic primarily based around the feeling of supernatural or out of this world happenings at night. It is often associated with a feeling of loneliness, but this is not necessarily a bad thing","The aesthetics that revolve around Spring are centered around motifs such as budding flowers and meadows, baby animals, sunshine, and a \"fresh\" and \"new\" feeling. Spring is an aesthetic that is focused around the season of the same name, At this time of year, with the melting of the Winter snow, farmers begin to sow seed, while others plant flowers","","Steampunk aesthetics come from a sub-genre of science fiction of the same name that incorporates technology and designs inspired by 19th-century fashion and industrial machinery (including steam-powered machinery, hence the name)","In a post describing Steelpunk on the SFFWorld website it is characterised as being \"about hardware, not software, the real world not the virtual world, megatechology not nanotechnology. The artefacts of Steelpunk aren\u2019t grown, printed or programmed, they\u2019re built","NOTE: Neurotypicals should avoid adopting this aesthetic and try Kidcore or maybe Scene instead.Stimwave is a largely visual aesthetic based on colorful fidget toys and sensory gifs often found on Tumblr and Pinterest, for neurodivergents, by neurodivergents","Stonepunk refers to works set roughly during the Stone Age in which the characters utilize Neolithic Revolution\u2013era technology constructed from materials more or less consistent with the time period, but possessing anachronistic complexity and function","Stoners are somewhat similar to the Hippie culture, yet they mainly focus more on using cannabis rather than other mind-altering drugs like psychedelics. They refer to the cannabis that they are using as the following: Marijuana, Weed, Kush, Herb, Pot, Smoke, Bud, Grass, and other names"," Thank you.Stripcore is an aesthetic inspired by a romanticized vision of strip clubs and other such establishments.  If this sort of content bothers you, please feel free to leave this page and check out another one","Studyblr is a subculture on Tumblr that is devoted to studying and taking notes in an organized and aesthetically pleasing manner","The studyplace aesthetic is an aesthetic around the idea of quiet, peaceful places to study. It ranges from studying on your bed to studying under a nice shaded tree","Styla is a subculture based out of Western Europe with many of its adherents being of Turkish origin","The motifs and photographs are American-centric, with parodies and dark interpretations of the 1950s nuclear family and 1980s economic boom. Suburban Gothic is an aesthetic based around feelings of alienation and the uncanny in suburban neighborhoods","The term is slang that translates as \"girl boss\" and is mainly used to refer to a violent feminist movement that emerged in Japan in the late 60s. Sukeban (\u30b9\u30b1\u30d0\u30f3) is a Japanese fashion derived from the looks of Japanese girl gangs","It can also be a reference to Summer fashion styles.It is widely considered the favorite season of many, considering that it is the vacation period of schools and many adults, attributing it a more carefree, cheerful and high-energy spirit. Summer is the hottest season of the year and an aesthetic that involves the season of the same name","Suprematism is an art movement focused on basic geometric forms, such as circles, squares, lines, and rectangles, painted in a limited range of colours. It was founded by Kazimir Malevich in Russia, and announced in Malevich's 1915 Last Futurist Exhibition of Paintings 0.10, in St","This fashion aesthetic was prevalent in award shows as well as graphic design. It is named after the mid-2000s fashion craze inspired by tv shows such as The OC and Laguna Beach","Surrealism is a cultural movement that started in 1917, and is best known for its visual artworks and writings. Artists painted unnerving, illogical scenes, sometimes with photographic precision, creating strange creatures from everyday objects, and developing painting techniques that allowed the unconscious to express itself","These memes are usually bizarre or absurd, with the punchline frequently being the obvious lack thereof. Surreal Memers are people who post or consume a subgenre of ironic memes called surreal memes","Swordpunk combines medieval aesthetics (ones generally found in fantasy and such) along with the weapons of the time with highly advanced futuristic technology such as mechs, holograms, gene recombination and AI. Although, while an aesthetic like steampunk has technology intermingled with the surrounding aesthetics, Swordpunk is a much more of a combination","While it is particularly regarded as a musical genre, there are examples of synthwave in movies, TV shows, art, and video games. The music strongly shares some key traits within the French House/Italo Disco musical genres","In 2019, a group called KEKENOKO tried to revive the style. 'Bamboo Shoot Tribe') refers to a style and a type of dance group that was active from the 1970s to the 1980s in Harajuku","Tenwave, also known as Nostalfagwave, is an aesthetic and artistic movement derived from Vaporwave and influenced by Milleniwave and Acidwave.Its main concept is inspired by the ironic and critical part of Vaporwave. It consists of a critique/parody/satire of cultural products of the 2010s, seeing them as decadent and trashy, remembering with nostalgia and better eyes those of previous eras with the exception of a few","Techwear is a fashion style that combines functionality with style and appropriate aesthetics","Warning: This page contains several mentions of violence.Teddy Boys made up a British subculture in the 1950s. This was led by working-class teens, many of which were involved in gangs","Technical Scene is usually classified by a mix between usual dark goth and emo culture, and modern or past technology and machinery, such as motherboards or typewriters.The origins of the aesthetic are currently unknown, as so is the time of origin","This aesthetic also includes the thought of being scared of the dentist.One of the common parts of teethcore is the fantasy figure known as the Tooth Fairy. It is believed if one places their baby teeth under a pillow, the Tooth Fairy will take it, and leave money in place of the tooth","","The Theatre Kid aesthetic focuses on acting and stage productions, most notably those that take place in a high school setting. People that are included in the theatre kid aesthetic includes:Stage crewCostumesTechieOrchestra and band membersActorsDirectors and screenwritersA stereotypical theatre kid can be outgoing, eclectic, and conservative","Thrasher, as we are choosing to use it in this context, refers to metalheads who have a specific preference to the thrash metal subgenre","Thriftcore is a aesthetic with the theme revolving around clothing, toys, furniture, and more of the like in thrift shops and garage sales","They are also often more chill and quiet in comparison to other girls.The tomboy concept has developed over the years, as stated in this article. However, you do not need to be LGBTQ+ to be a tomboy","Trad goths listen to officially classified goth music, such as; goth rock, deathrock, darkwave, coldwave, minimalwave and etherealwave. Trad goth fashion includes backcombed hair, black clothing and dark makeup","Traditional Polish is an aesthetic that revolves around the traditions and folklore associated with the Polish-Lithuanian Commonwealth, its nobility and various other groups. There are variations which vary depending on influences, social status, wealth and area","It incorporates many elements of Camp and Kitsch; it is a total subversion of what is deemed to be good taste in contemporary American society, as it openly celebrates identities that are shamed in American society: the poor, drag queens, sex workers and the kink scene, and rural \"uncultured\" communities. Mature Content and Trigger Warning: The article mentions sexual motifs and gun violence.This page is under construction","Trashcore is an aesthetic based around decaying, abandoned buildings and general garbage","It is worth noting that some people who have went through trauma and use traumacore have stated that traumacore is an aesthetic, (albeit a special kind of aesthetic) while others state that it isn't, since those without trauma may try to romanticize the experiences of traumatized individuals. Traumacore is more of a type of art therapy or visual journaling for many people with trauma","However, not every transgender or nonbinary person will have debilitating gender dysphoria that constantly wrecks havoc on their lives. Trendercore is an aesthetic created by uwumars on Tumblr, dedicated to transgender and non-binary self-love","Trillwave is a very important internet aesthetic revolving around both music, clothing, and visual art. You will not find a single person in the Cloud Rap &amp; Trillwave community who does not know Yung Lean.In the end, Trillwave was birthed from thing to thing to thing and it is hard to track down the true pinpoint origin of it","Tropical is an aesthetic that is based on comfort, ease, and utility and is eclectic by definition. The style is characterized by warm and soothing themes and colors drawn mostly from natural elements such as the sea, sky, and vegetation (plants, fruits, flowers, etc)","Tupinipunk(name derived from tupiniquim, a major native-brazilian ethnic group and a slang to refer to anyone or anything that is brazilian) is a term generally used to refer to the sci-fi/Cyberpunk movement in Brazil, predominantly on the literary scene. It was originally coined in the 2000s, to describe a satirical genre that criticized the predominant US-centric and Eurocentric views of the sci-fi genre","Tweencore is an aesthetic that shares some similarities with Kidcore, maintaining the nostalgic and \"childish\" themes, but also embodying teen spirit often associated with the High School Dream aesthetic. It tends to borrow heavily from Animecore (especially more feminine animes like Sailor Moon and Fruits Basket), Scene, and Old Web (while also taking some fashion cues from the McBling aesthetic that this was inspired by)","The term 'Twee', defined as a British term meaning \"affectedly or excessively dainty, delicate, cute, or quaint\", is the baby-talk mispronunciation of sweet and is seen in the lexicon as early as 1905","Ukiyo-e is a genre of Japanese art that flourished from the 17th through the 19th centuries. Its artists produced woodblock prints and paintings of such subjects as female beauties; kabuki actors and sumo wrestlers; scenes from history and folk tales; travel scenes and landscapes; flora and fauna; and erotica.Ukiyo-e displays an unusual approach to graphical perspective, one that can appear underdeveloped when compared to European paintings of the same period.Typical subjects of Ukiyo-e paintings were female beauties, kabuki actors, and landscapes","Ulzzang, (\uc5bc\uc9f1) is a popular South Korean term literally meaning \"best face\", deriving from the Korean words face (\uc5bc\uad74) and best (\uc9f1). The trend is unisex and is practiced by both males and females","Urbancore is an aesthetic based on imagery of urban cities and street life. Urbancore is associated to real-life, modern-day society and almost always is based in recent decades","Unicorncore is an aesthetic based on unicorns. This aesthetic spreads positivity for everyone","Vacation Dadcore is a style aesthetic focusing on Hawaiian prints, socks and sandals, wide-brim hats, tan lines and that relaxing vacation lifestyle. The aesthetic stems from the low effort, comfortable but also practical style commonly worn by dads on holiday","A Vampire is a creature from folklore that subsists by feeding on the vital essence (generally in the form of blood) of the living","But the unique and iconic visual aesthetic cultivated alongside it is now, debatably, more popular and recognizable than the music itself. Vaporwave is a music genre branching from electronic Chillwave","Vibrant Academia is an academic aesthetic similar in theme and style to Light Academia and Pastel Academia but with brighter hues. Vibrant academia focuses on the joy of learning and the pursuit of knowledge out of curiosity","","Victorian Goth is a style that merges the classic trends of Victorian fashion with Goth sensibilities","Vintage is an umbrella term used to refer to aesthetics which evoke a certain period (or mixture of periods) from the past","Vintage Academia is an aesthetic or a set of aesthetics revolving around the style of studying from past eras. As in all Academia aesthetics, the pursuit of knowledge, studying and learning is a core component of Vintage Academia, but it differs with its focus on older methods and styles","Vintage Parisian is a feminine aesthetic that takes influence from mid-twentieth century Paris and similar cities like New York and London, luxury brands, and old Hollywood movies. This aesthetic was embodied by the original films, advertisements, and brands, and was later collected into moodboards and blogs by women on tumblr, and later tiktok","There is also an urge to surround oneself with friends and help them grow and bloom as well. The art also has a philosophical tone along with the feeling of understanding and appreciation of togetherness, the goal of growing into the bright bloom we want to be, to change and grow, to live a life full of our own beauty, inside and out"," As it is primarily a visual style, it's impossible to pin down visual kei by hearing alone, and to dismiss a band as \"not visual kei\" based on their sound is unwise, as the music can range from J-pop to extreme metal to electronic dance music. Determining whether a band is visual kei or not is generally rather easy - it can be as simple as looking at images of the band, and either the fans or the artists themselves will be sure to let you know if they are, as it's generally a conscious choice to be a part of the scene","VSCO is a family of aesthetics named in reference to a photography app called VSCO (formerly known as VSCO Cam), created by Joel Flory and Greg Lutze in 2011. VSCO gained prominence with its in-app suite of features that allow users to edit with preset filters and tools","It is exclusively for groups and individuals who face dehumanization from society. Voidpunk is a subculture among dehumanized groups that is normally described as the rejection of the human identity, and embracing being nonhuman","Vorticism is an early 20th-century modernist movement in British art and poetry. It aimed to create art that expressed the dynamism of the modern world","Several methods are used to enhance the appearance of pieces; including dying, crystallization, and diaphonization; making jewelry from smaller bones or paws is also popular. Practitioners, (called \"vultures\"), may choose to preserve an entire animal, body parts, pelts, or bones","The aesthetic is sometimes described as one of beauty that is \"imperfect, impermanent, and incomplete\". In traditional Japanese aesthetics, wabi-sabi (\u4f98\u5bc2) is a world view centered on the acceptance of transience and imperfection","In addition to aesthetic images, much of this information comes from memes, whisper confessions, and text posts of things happening within their personal lives.  What distinguishes this aesthetic from the previous aesthetics above is the persona of these bloggers","Wanderlust is a strong desire to wander or travel and explore the world. Wanderlust may reflect an intense urge for self-development by experiencing the unknown, confronting unforeseen challenges, getting to know unfamiliar cultures, ways of life and behaviours or may be driven by the desire to escape and leave behind depressive feelings of guilt, and has been linked to bipolar disorder in the periodicity of the attacks","Warmcore is an aesthetic that is related to Cottagecore, Naturecore and other nature/farm-related aesthetics. Warmcore aesthetics usually warm, bright lighting over a usually nature centered aesthetic","on the internet. This is about creepy things on the internet, the dark web, and the overall mysterious and creepy content of the internet","Amateur editing, primitive digital graphics, lo-fi photography and image compression are some of the most common elements found in Weirdcore images. Weirdcore is an online aesthetic and art movement centered around amateur or low-quality photography and/or digital graphics that have been constructed or edited to convey feelings of confusion, disorientation, alienation, and nostalgia or anemoia","The Western aesthetic (also known as the Wild West) is a popular genre inspired by the lives of early settlers of the American Frontier. Visually, the Western aesthetic shares many similarities to that of Country, but places an emhasis on imagery of the historical Wild West, as well as the motifs of vigilantism and adventure commonly depicted in popular Western films","It can also be a reference to Winter fashion styles.During this time of the year, people tend to stay more at their homes to not be exposed to the low temperatures, making the season be associated with more calm, cozy elements. Winter is the coldest season of the year in polar and temperate zones","Witchy Academia is an aesthetic that revolves around folklore, the pursuit of reading, writing, and casting spells, and a general passion for potion making and spell casting. Academia is the environment or community concerned with the pursuit of research, education, and scholarship","Witch House is an aesthetic that originated with the music genre of the same name","Witchcore is an aesthetic centered around the themes of witchcraft. It often involves how to perform spells, magic, or gem collecting","Wizardcore is an aesthetic based off of magic, fantasy and the taste for discovery and exploration","","Woodland Goth is an Internet aesthetic that combines dark, romantic elements of Goth culture with light subjects like flowers or soft woodland animals. The aesthetic is based off woodland survival and agriculture with a gothic twist","Wormcore, also tagged as Worm Time, is based on the toys known as Worm On A String, Magic Worm, and Squirmles. Squirmles (also known as Snoots, Magic Twisty Worms, or Worm on a String) are small, worm-like toys with eyes, a furry body, and a hidden string used to imitate a live worm, sometimes used as a magic trick","Writer Academia is an aesthetic that revolves around the art of writing, be it poetry, novels, or even fanfiction. It is centered around the idea that writing is for everyone, and the quality of work does not matter as long as you are passionate about it and having fun","Y2K (also known as Kaybug) is an aesthetic that was prevalent in popular culture from roughly 1995 to 2004. The Y2K era ended in late 2004 and was succeeded by the Frutiger Aero and McBling era.Y2K aesthetics could've possibly been inspired by other previous futuristic aesthetics such as Retro-Futurism","Warning: This article is only addressing the aesthetic that surrounds the Yakuza. This article is, in no way, glorifying the actions of the Yakuza, past or present","It is part of Anti-Kawaii which adds opposing elements to typical the kawaii style in order to leave a greater impact. Also, keep in mind that this shouldn't be used as just a cutesy aesthetic.Yami Kawaii (\u75c5\u307f\u304b\u308f\u3044\u3044) is a Japanese aesthetic that was derived from Yume Kawaii with a stronger emphasis on dark themes and colors","Yankeecore is the romanticization of New England. New England is a region comprising six states in the northeastern United States: Maine, Vermont, New Hampshire, Massachusetts, Rhode Island, and Connecticut","Although it is rumored that yankii would be recruited into the yakuza (the Japanese mafia), this is not always true. Yankii could be recognized by punch perms or pompadours, shaved eyebrows, altered school uniforms, popping squats, being poor students and causing violence or trouble","Yume Kawaii (\u3086\u3081\u304b\u308f\u3044\u3044) is a Japanese aesthetic that refers to pastel, fairytale, fantasy-like things. It appears like the embodiment of a \u201cgirls dream\u201d and you can find many illustrations, clothing, and goods, which incorporate this","Warning: This page discusses mental health and other sensitive topics. If talks of blood, mental illness, or abusive relationships disturb you, tread lightly on this page and if you feel any sort of mental health problems are consuming you, please get in touch with a mental health professional and get whatever help you need","Zef is a South African counter-culture movement that has been compared to anarchic sub-cultures in the northern hemisphere.Zef was originally a derogatory term used to refer to working-class whites in the 1960s and 1970s","Zentai is a type of fashion that is a skin-tight garment that covers the entire body, they come in many styles, colors, and designs.  Originating in Japan, this form-fitting outfit has been used around the world for a variety of activities; marketing/advertising, film, sporting events, street dancing, and performance art (just to name a few)","Zombiecore is an aesthetic based on the feeling, sensation, and visuals of being a zombie or surviving a zombie apocalypse","1950s Suburbia describes the culture of the American middle class in the 1950s. The most famous example is Levittown, in New York state, which was the prototype for mass produced, mass-scale housing.The government led push for a return to normalcy (i.e., traditional gender roles) following World War Two, created an idealized image of the American family and the United States itself","2 Tone is a genre of music that combines ska (brought over by waves of Jamaican immigrants to the UK) with certain elements of punk and new wave. Despite the contradicting styles, 2 Tone blends these genres, making for a faster rendition of the ska genre","70s disco is an aesthetic related to the disco trend originating in the 1970s"]},"selected":{"id":"4930"},"selection_policy":{"id":"4929"}},"id":"4854","type":"ColumnDataSource"},{"attributes":{},"id":"4845","type":"ResetTool"},{"attributes":{},"id":"4935","type":"UnionRenderers"},{"attributes":{},"id":"4934","type":"Selection"},{"attributes":{},"id":"4930","type":"Selection"},{"attributes":{},"id":"4936","type":"Selection"},{"attributes":{"coordinates":null,"edge_renderer":{"id":"4794"},"group":null,"inspection_policy":{"id":"4928"},"layout_provider":{"id":"4796"},"node_renderer":{"id":"4790"},"selection_policy":{"id":"4827"}},"id":"4787","type":"GraphRenderer"},{"attributes":{"children":[{"id":"4839"}]},"id":"4899","type":"Column"},{"attributes":{"fill_color":{"value":"#abdda4"},"size":{"field":"deg"}},"id":"4807","type":"Circle"},{"attributes":{"coordinates":null,"data_source":{"id":"4858"},"glyph":{"id":"4877"},"group":null,"hover_glyph":{"id":"4887"},"selection_glyph":{"id":"4882"},"view":{"id":"4860"}},"id":"4859","type":"GlyphRenderer"},{"attributes":{"child":{"id":"4899"},"title":"Aesthetics Wiki graph"},"id":"4900","type":"Panel"},{"attributes":{"high":8,"low":0,"palette":["#30123b","#311542","#32184a","#341b51","#351e58","#36215f","#372365","#38266c","#392972","#3a2c79","#3b2f7f","#3c3285","#3c358b","#3d3791","#3e3a96","#3f3d9c","#4040a1","#4043a6","#4145ab","#4148b0","#424bb5","#434eba","#4350be"
