ution","Normcore","Rusticcore","Fairy Academia","Juggalo","Breakcore","Victorian","Hauntology","Lolita","New Age"],"partition":[2,4,2,7,2,7,2,2,1,4,1,7,1,1,1,1,2,1,1,4,5,1,1,1,null,0,2,3,1,7,1,2,1,3,3,0,1,3,6,0,7,1,1,4,1,6,2,2,2,0,6,2,null,4,2,2,1,1,1,1,1,2,1,4,2,7,3,8,3,1,4,7,5,7,3,2,6,2,1,1,0,0,1,7,3,4,3,2,4,5,1,0,0,2,4,3,0,0,4,7,4,0,4,4,1,6,4,3,null,1,5,0,1,1,8,1,6,null,4,0,1,4,5,0,7,4,4,0,4,8,1,2,3,1,0,7,6,3,4,5,1,4,1,0,1,8,7,2,1,2,0,4,2,5,1,2,3,2,7,4,4,1,null,2,7,5,6,0,0,3,8,8,1,null,1,7,0,3,1,0,7,4,1,1,5,0,3,2,2,2,4,3,1,2,0,3,2,8,1,3,0,1,7,3,null,5,3,8,2,4,2,null,0,2,6,1,4,1,3,0,8,2,7,4,5,4,2,2,5,7,1,1,4,5,2,0,3,null,1,null,1,3,null,1,7,8,1,0,6,2,3,1,1,2,2,0,2,7,2,0,1,1,4,1,7,1],"summary":["There is also a portion of the aesthetic community that related Knightcore to Rangercore, using the shared themes of combat and nature visuals. Like the related aesthetic Princecore, a section of this aesthetic is centered around gay relationships and the two are often paired together","Members of the original Scene subculture were nicknamed Scene kids, Scenesters, or Trendies. Scene is often confused with or used interchangeably with Emo, a subculture that formed from the music genre \"emotive hardcore\"","The Western aesthetic (also known as the Wild West) is a popular genre inspired by the lives of early settlers of the American Frontier. Visually, the Western aesthetic shares many similarities to that of Country, but places an emhasis on imagery of the historical Wild West, as well as the motifs of vigilantism and adventure commonly depicted in popular Western films","This aesthetic was created through a negative view of popular trends seen mostly adopted by white teenagers and young adults, and is often used as an insult to these demographics. This aesthetic is often used by major media companies when creating female characters to make them more relatable to a larger audience","Other than home decor, fans of the look typically have hobbies adjacent to the vintage and feminine aesthetic, such as gardening, baking, sewing, and reading. Shabby Chic is an aesthetic, typically in interior design, that centers around distressed and worn-out appearing furniture from the Victorian era","","    The aesthetic is used to connect modern Americans with the people of the past in a desire to create national culture, connect with American values, and interest people in American history.    Another motif is the simultaneous fear and romanticization of nature","The aesthetic is similar to Softie, but, unlike it, doesn't have a wide variety of possible colour palettes and focuses on peaches instead of gentleness. Peach is an aesthetic that revolves around things that are considered peachy, the fruit of the same name or the colour","In fact, one of the main motivators of becoming a mall ninja could come from wanting to be like an anime character or because of the Dunning-Kreuger Effect; a Weeaboo may mistake the hours of anime they watched as weapons training. Mall Ninja is a set of stereotypes about men who claim to be badass and have an interest in weapons, anime, and action movies","Grunge fashion was made popular by bands like Nirvana, Pearl Jam, Alice in Chains, and Soundgarden, and was meant to be timeless and quite casual.Grunge started in 1985 with Green River's album Come on Down, but it did not become mainstream until the 1990s with Nirvana's Nevermind. Grunge was most popular from roughly 1991 to 1997, and eventually lost its anti-consumerist philosophy","Technical Scene is usually classified by a mix between usual dark goth and emo culture, and modern or past technology and machinery, such as motherboards or typewriters.The origins of the aesthetic are currently unknown, as so is the time of origin","Circuses may also have elements of fantasy. Barnum's circuses","Laborwave  is a derivative of Vaporwave that is less subtle about its critiques of capitalism and take advantage of this aspect of Vaporwave to promote a communist or socialist agenda. Laborwave creators (much like Fashwave creators) will often confuse Synthwave aesthetics and Vaporwave aesthetics, which generally leads to both mixing and matching the two aesthetics without really understanding the differences between Synthwave and Vaporwave","Many elements of Lo-Fi are comparable to or heavily draw from to Vaporwave, Anime, Cartooncore, Spiritcore and Vintage. Lo-Fi is a largely music-centric aesthetic that utilizes muted tones and mundane imagery to evoke a feeling of calm and nostalgia","A cyberprep world assumes that all the technological advancements of cyberpunk speculation have taken place but life is utopian rather than gritty and dangerous. Cyberprep is a term with a very similar meaning to postcyberpunk","Essentially consisting of screencaps and gifs, Old Web is an aesthetic utilizing traditional web design elements combined with aspects of poetry and self-expression. This aesthetic expresses nostalgia for Internet culture of the mid-1990s to late 2000s (spanning roughly Windows 95 to the glory days of YouTube).Old Web's philosophical heart yearns for the days of uninhibited individualism of the old web, before the internet became streamlined and social media monopolized how people communicated, and web graphic design developed a stricter set of rules for the \"dos\" and \"don'ts\" for the sake of accessibility and marketing.Many Old Web screencaps and gifs come from archived Geocities websites made by amateur coders and animators","Similarly, Juggalos and the Amish do not fall under the \"Americana\" umbrella, though Yeehaw might.Much of the aesthetic is characterized by nostalgia for an idealized or imagined past, often seen as \"more wholesome\" than modern American tastes and mores. There is considerable disagreement over what counts as \"American\" because vast differences exist between different regions and subcultures within American society","Health Goth is an aesthetic revolving around biotechnology, monochrome sportswear, fetish culture, extreme cleanliness, and rendered environments. Health goth has roots in \"street goth\" but focuses on trans-humanism, Net art, technical sportswear, bionic body parts, combat gear and an understanding of physical and mental health","",""," The female equivalent is often referred to as a \"Chavette\". Although often used as a label for anyone perceived as loutish, violent and anti-social, it is also very frequently used as a classist term in England used to discriminate against white people in the North of England and the working class","Viewer discretion is advised.Milleniwave is an aesthetic born from an overall sense of Millennial frustration and existential dread with the direction society is going by trying to put a happy face and a bright, colorful facade over it that does a piss-poor job of actually hiding it. Warning: Milleniwave visuals do have the potential to trigger seizures due to flashing, bright, and/or obnoxious colors and lights","Y2K (also known as Kaybug) is an aesthetic that was prevalent in popular culture from roughly 1995 to 2004. The Y2K era ended in late 2004 and was succeeded by the Frutiger Aero and McBling era.Y2K aesthetics could've possibly been inspired by other previous futuristic aesthetics such as Retro-Futurism","Although this trend seems to have diminished somewhat, the preference for bright, happy colours remains, which is unsurprising, considering how many furry characters are - directly or indirectly - inspired by cartoons. How these furry characters are depicted can differ vastly from artist to artist","\"We wanted to reflect that diversity with our costume decisions","Abstract and austere, constructivist art aimed to reflect modern industrial society and urban space. The movement rejected decorative stylization in favor of the industrial assemblage of materials","Cottagegore (also known as Goth Cottagecore or Dark Cottagecore) is similar to Cottagecore, in the sense it has a strong focus on country life, baking, and vintage items, but contrary to its name, it instead includes darker aspects of nature (including rotten mushroom or plant aesthetics, forest cryptids, spirits or ghosts, and bones found in nature) as opposed to just taking the Cottagecore aesthetic and throwing a bunch of blood and gore on it","Dreamy (also known as Dreamcore) is an aesthetic that revolves around dreams","It's apt to say that cyberpop is the child of cybergoth and kandi kid aesthetic styles. Cyberpop is primarily a fashion aesthetic with roots in Cybergoth and Raver","Pastel is an aesthetic that relates to pastel colors. The pastel colors can be created by adding white, and the more white adding into the original shade, the paler the pastel will be","It can be divided into two subaesthetics, each of which looks vastly different - High Cleancore deals with the adult world and products aimed at adults, such as washed-out soaps and sterile hotel rooms, while Low Cleancore deals with products aimed at children, such as bath toys and rubber ducks.As a continuation of many of its predecessors, Cleancore cynically embraces capitalist imagery. Cleancore (also known as Safetycore or Safetygoth) refers to an aesthetic based around clean objects or objects intended to sanitize, such as soaps, sponges, and bathtubs, as well as places that may seem to have been recently cleaned","Wanderlust is a strong desire to wander or travel and explore the world. Wanderlust may reflect an intense urge for self-development by experiencing the unknown, confronting unforeseen challenges, getting to know unfamiliar cultures, ways of life and behaviours or may be driven by the desire to escape and leave behind depressive feelings of guilt, and has been linked to bipolar disorder in the periodicity of the attacks","Tenwave, also known as Nostalfagwave, is an aesthetic and artistic movement derived from Vaporwave and influenced by Milleniwave and Acidwave.Its main concept is inspired by the ironic and critical part of Vaporwave. It consists of a critique/parody/satire of cultural products of the 2010s, seeing them as decadent and trashy, remembering with nostalgia and better eyes those of previous eras with the exception of a few"," Queercore media (such as music, zines, and books) effectively opened what can be termed a queer counter-public sphere in opposition to the institutions of the lesbian and/or gay public sphere already in existence and exemplified by organizations like GLAAD and NGLTF, spaces like established middle-class gay neighborhoods, or events like the Michigan Womyn's Music Festival or Gay Pride marches.Curran Nault, in his book Queercore: Queer Punk Media Subculture, describes queercore as \u201ca configuration of artistically minded gender/sexual dissidents who annex punk practices and aesthetics to challenge the oppressions of the mainstream and the lifeless sexual politics and assimilationist tendencies of dominant gay and lesbian society.\u201dQueercore stands against the mainstream gay politics of integration with cishet (cisgender, heterosexual) society and the culture of respectability politics that is common among the majority of people in the LGBTQ+ community. Queercore (also known as homocore), is a cultural and social movement that began in the mid-1980s as an offshoot of the punk subculture"," A often mentioned inspiration for the style are the musicians Kim Shattuck of the band The Muffs, Christine Amphlett of the band Divinyls or Katie Jane Garside of the band Daisy Chainsaw. It is believed that Kat Bjelland from the band Babes in Toyland was the first to wear and define the look, while her former roommate Courtney Love from the band HOLE was the first to popularize it.Courtney Love, who popularized kinderwhore, commented in 1994 that 'I would like to think\u2014in my heart of hearts\u2014that I'm changing some psychosexual aspects of rock music","Pastel Academia is one of the many variations of the Academia aesthetic and subculture. Someone who is a part of the Pastel Academia aesthetic is less mature and more child-like than those who identify with the other versions of academia","Up until the 60s, the meaning also included rock 'n roll, but afterward came a proper definition and musical consolidation. Pop, also known as popular, is a music genre that originally emerged in the mid-50s in the USA and the UK","It's still necessary to acknowledge even harmful influences on modern visual culture, but we at the Aesthetics Wiki DO NOT condone the romanticization of pedophilia and child abuse. As an aesthetic, this word refers to the style of Dolores Haze in the movies, that influences the fashion nowadays","Neo-Romanism is an aesthetic influenced by Bronzepunk, Sandalpunk, Neoclassicism, Futurism and Renaissance, among others. Neo-Romanism began to boom with the popularization of neo-pagan religions such as Hellenism and the Roman Way at the end of the 20th Century, which have influenced its \"romantic\" vision of those times","The participants of this aesthetic place a great importance on appreciation of the arts and the luxurious lives of the Italian nobility, such as in masked balls. Romantic Italian is an aesthetic built upon the romanticism of the culture of Italy, particularly its idyllic countrysides, rich history, fashion culture, and languid society","The Babygirl aesthetic can vary from Babycore to Baddie to E-Girl or Pastel Goth. Babygirl encompasses sweet and innocent imagery and attitudes that give the adult wearer an overall childlike feel","Hip-hop, also called rap music, is a genre of popular music developed in the United States by inner-city African Americans and Latino Americans in the Bronx borough of New York City in the 1970s","Real Life Super Hero (often shortened to RLSH) movement is an aesthetic that involves dressing up like comic book character and generally engage in good deeds, where it can range from simple things like visiting sick children in a hospital to simple neighborhood watches to more controversial actions like actual vigilantism which is dangerous.  The aesthetic has a small relation to Kidcore, in the sense that it ties into a child-like notion of justice and wanting to do right","Hot Topic is an aesthetic surrounding the fashion and products from the shop, Hot Topic, throughout its long and storied history","Holosexual is the aesthetic of shiny and reflective or holographic imagery. Holographic items are often confused with iridescent, multi-chrome, and any item with a shiny surface","It tends to use a distinct, brightly-colored art style. Atompunk is an aesthetic centered around a view of the future from the perspective of the 1950s","While the examples mentioned earlier are good guides, take a look at the image on the right for more modern inspiration.For example, a cabin in the middle of the woods, surrounded by vines &amp; trees, living off rainwater &amp; produce, feeding toads &amp; deer while collecting their bones for decoration. Or, an apartment with solar panels with plants dotting the walls, rocks &amp; buttermoths moving around, buying locally &amp; dressed in greens &amp; light browns","It can also be related to exploring, and even researching or preservation of the jungle. Junglecore is also associated with creatures such as orangutans, Indian elephants, treefrogs, leopards, and many more","Rococo, often called late Baroque, was an architectural and artistic style developed in France in the first half of the eighteenth century. Rococo art rejected the dark solemnity of the Baroque aesthetic, while maintaining the ornamentation","Vibrant Academia is an academic aesthetic similar in theme and style to Light Academia and Pastel Academia but with brighter hues. Vibrant academia focuses on the joy of learning and the pursuit of knowledge out of curiosity","Steampunk aesthetics come from a sub-genre of science fiction of the same name that incorporates technology and designs inspired by 19th-century fashion and industrial machinery (including steam-powered machinery, hence the name)","Gloomcore is an aesthetic inspired by the tranquil forests and foggy beaches of the pacific northwest, and obscure hobbies and interests. Those who take a liking to such genre tend to find beauty in cloudy skies, foggy coastlines and tall, endless, green forests"," It should be important to note, however, that the Skinheads weren't always a white supremacist aesthetic and we hope this page actively promotes the idea that the Skinhead aesthetic isn't inherently racist and only got infected by racists later on.Skinheads are members of a subculture originated among working-class youths in London, England, in the 1960s and soon spread to other parts of the United Kingdom, with a second working class skinhead movement emerging worldwide in the 1980s.\"Skinheads\" started as an fashion/subculture heavily influenced by the Jamaican Rudeboys and Ska music which had brought to England by West Indian immigrants, as well as British Mods, African-American soul and R&amp;B, and early Rock and Roll.The early skinheads were not necessarily part of any political movement, but as the 1970s progressed, the skinheads became more politically active and acts of racially motivated skinhead violence began to occur in the United Kingdom and did become divided along far-right and far-left lines. The white power and neo-Nazi skinhead subculture eventually spread to North America and other areas of the world","This can also include the indie movie genre, as many movies in the genre add to the original indie aesthetic. The indie aesthetic is based on individuality and independence","Baroque is a term used to describe the predominant style of European architecture, music, and art of the 17th and 18th centuries. Though relatively minor, the 20th and 21st centuries have seen a renewed and prolonged interest in Baroque music, art, and motifs","Witchcore is an aesthetic centered around the themes of witchcraft. It often involves how to perform spells, magic, or gem collecting","McBling is an aesthetic that was popular from roughly 2003 to 2008, succeeding the Y2K aesthetic. It was coined through a Facebook page in 2016 made by Evan Collins of the Y2K Aesthetics Institute","\"Punk\" intends to reference both the futuristic setting of a Lunarpunk society as well as the struggle against a more suspicious, mysterious government/overruling power. Visuals of the aesthetic are borrowed from pagan, satanic, Wiccan, or anarchist references, and the architecture is a mixture of futuristic shapes as well as mushroom-inspired, luminescent, nature-based designs","","Ballard, Philip Jose Farmer, and Harlan Ellison as they examined the impact of drug culture, technology, and the sexual revolution while avoiding the utopian tendencies of earlier science fiction.Settings in the cyberpunk genre range from the richly colored, rough-around-the-edges urban jungles of Akira (1988), to the hyper-futuristic, neon cityscapes and bleak wastelands of Blade Runner 2049 (2017), with the first work in cyberpunk fiction being William Gibson's Neuromancer novel.Themes used in cyberpunk media involve artificial intelligence, class uprising, governmental and corporate corruption, anarchy, gang warfare, and transhumanism. The range is broad but the cyberpunk aesthetic is often used to convey deeper meanings and commentate on modern society and sometimes predictions of our future society.Cyberpunk was likely the partial inspiration (or anti-inspiration) for Solarpunk - an aesthetic that also aspires to cast a glance into the future, but does so with a much less nihilistic perspective and played a role in inspiring Vaporwave since both seem to share a seeming disdain for mainstream capitalism, but Vaporwave is more sarcastic and mocking compared to Cyberpunk, which is more open with its disdain for the corporate dystopia","Psychedelia refers to psychedelic art, psychedelic music and the subculture that originated in the psychedelic experience of the 1960s, by people who used psychedelic drugs such as LSD, mescaline (found in peyote) and psilocybin (found in magic mushrooms). Psychedelic art and music typically recreate or reflect the experience of altered consciousness"," Despite a number of its followers taking a progressive and subversive outlook on life, Cottagecore has been also criticized for its romanticism of eurocentric farming life. It is due to these connotations that the use of Cottagecore aesthetics has been adopted by the TradWives community and members of the far-right as forms of propaganda","It's said the term originated with rapper Drrty Pharms in an interview with Mishka:Icepunk, like seapunk, is more of a meme than it is a genre. I wanted to mimic the numb, uncomfortable feeling of being cold\u2026.After the creation of seapunk, [Facebook groups] were flooded with posts proclaiming the death of witch house, posts antagonizing the seapunks and people claiming to have created the next meme genre","Nu Goth is a modern take on goth subculture that is heavily rooted and influenced by traditional gothic music, aesthetic and philosophy. Its followers are deeply philosophical by nature and have a great interest in studying the human condition often through psychology, philosophy, and the occult","Where goblins collect ugly and crows collect trivial things, a dragon collects \"worthy\" treasures. The difference to the other two aesthetics lies in the hoard","Themes often associated with this aesthetic are neon signs, sweets, muffled pop songs and fairground rides. Carnivalcore is an aesthetic based around the nostalgic and joyful experience of visiting the carnival","The term is very popular on Tumblr and among school kids. Crackhead (not to be confused with Drugcore enthusiasts who are literal crackheads) is an aesthetic centered around being chaotic, unpredictable, stupid, clumsy, lazy, and inconvenient dumbasses","Tropical is an aesthetic that is based on comfort, ease, and utility and is eclectic by definition. The style is characterized by warm and soothing themes and colors drawn mostly from natural elements such as the sea, sky, and vegetation (plants, fruits, flowers, etc)","It is worth noting that some people who have went through trauma and use traumacore have stated that traumacore is an aesthetic, (albeit a special kind of aesthetic) while others state that it isn't, since those without trauma may try to romanticize the experiences of traumatized individuals. Traumacore is more of a type of art therapy or visual journaling for many people with trauma","A key factor here is that said materials, often pieces of trash, are being used for something other than their original purpose (as opposed to simply being repaired and reused). The commonplace refurbishing of western e-waste in developing countries where they are resold and used again","The usage of the term has evolved dramatically over the years. Therefore, the definition of the term \"emo\" can vary, depending on the subject and decade","","It can also be paired with Crystalcore as it pertains to some jewelry worn within the Pearly aesthetic. A sort of heavenly vibe is also incorporated","LARME magazine is a Japanese magazine founded in 2012 and described as a \"sweet and cute girl's fashion picture book.\" by Haruna Nakagoori. The fashion magazine has a distinctly feminine style that balances kawaii and sexy elements, with multiple vintage-inspired pieces and interesting textures","The aesthetic is one that has largely fallen out of popularity due to the current notoriety of Traumacore, the insular community, mental recovery of many influencers, and discourse surrounding the aestheticization of dark themes. This is a page that will be part of a series on more anthropological approaches with interviews and noted influencers.Trigger warning: This article has a focus on topics of abuse, mental illness, eating disorders, and religious abuse","Another aspect of cryptidcore is the romanticization of cryptids. Cryptidcore is also, generally vintage, and takes visual inspiration, especially with regards to fashion, from the 1970s - 90s","Often times, Decopunk will use slightly more modern technology compared to the times it's supposed to evoke like VHS tapes. It has a sleeker and shiny aesthetic compared to Dieselpunk, which has a tendency to be more gritty and dark aesthetic to it","Like the American pioneers, this aesthetic finds power in freedom and experimenting with new things by using the old as inspiration. Prairiecore emerged from the American boho aesthetic during the 1970's, as an offshoot of the hippie/ flowerchild movement","Others come from countries where the Chinese language is used by much of the population, such as Singapore and Malaysia. C-pop is an abbreviation for Chinese popular music, a loosely defined musical genre by artists originating from mainland China, Hong Kong, and Taiwan","Due to the role the Nazi Party played in history and the subsequent sensitive and offensive nature of this aesthetic, it is not recommended that you adopt it for yourself. Aesthetics Wiki does not endorse Nazi ideology - but it is important to acknowledge its impact on modern culture.''Nazi Chic is an aesthetic centered around the use of Nazi-era style, imagery, and paraphernalia in clothing and popular culture, especially when used for taboo-breaking or shock value rather than out of genuine sympathies with Nazism or Nazi ideology, although it can be used as a tool to critique elements of contemporary society by drawing allusions to the Nazi Party and their laundry list of evils they committed.A popular use of the Nazi Chic aesthetic occured in the mid-1970s with the emergence of the Punk movement in London: the Sex Pistols' first television appearance occurred with a person of their entourage wearing a swastika","A movie about the Club Kids was made through World of Wonder Productions (the same production company behind the world-famous RuPaul's Drag Race) called Party Monster starring Seth Green as James St. James and Macaulay Culkin as Michael Alig based on the novel James St","Musical Academia is not strictly adherent to school curriculum, as self-teaching may be just as effective and valid within the aesthetic. Musical Academia is an aesthetic involving the art and education of music theory, culture, creation, and learning instruments and vocal techniques","Cybergoths are often considered part of the industrial subculture, and not the Goths (if due to the fact the Goths have absolutely no love for the Cybergoths whatsoever).Some people don't think Cybergoth is a subculture in itself, but more of a variation in aesthetic on cyberpunk or raver fashion. Cybergoth is a subculture that derives from elements of Goth, Raver, Rivethead, and Cyberpunk subcultures","There is heavy emphasis on creating connections between certain imagery and motifs through creating moodboards and compilations/parallels/web-weaving (explained below). The community surrounding that aesthetic stems from a shared admiration for poetry, quotes from literature, music, and artworks that are circulated via reblogs on tumblr","The motifs and photographs are American-centric, with parodies and dark interpretations of the 1950s nuclear family and 1980s economic boom. Suburban Gothic is an aesthetic based around feelings of alienation and the uncanny in suburban neighborhoods","Thrasher, as we are choosing to use it in this context, refers to metalheads who have a specific preference to the thrash metal subgenre","While the aesthetic is not as predominant on the several social media sites out there yet, such as Instagram, TikTok, and others, the community notably began and prospered on Tumblr.It should be noted that this aesthetic sometimes is confused with Light Academia due to similar color palette and some key values. However, one main difference between the two is that Light Academia(and all aesthetics with the Academia suffix, for that matter) is that it is focused on learning, studying, and a thirst for knowledge","The original creator, Tumblr user advenchurre (now deactivated) has stated \"It's about the idea of navigating the world like you're a protag about to set off on a big cross-country journey. The main theme and philosophy are encouraging curiosity and having a yearning to see it all","Glitter rock was a more extreme version of glam.The UK charts were inundated with glam rock acts from 1971 to 1975. Other British glam rock artists include David Bowie, Mott the Hoople, Sweet, Slade, Mud, Roxy Music and Gary Glitter","A Femme Fatale is a mysterious, intelligent, beautiful, and seductive woman whose charms ensnare anyone who meets her, often leading them into deadly traps and webs of crime","Tupinipunk(name derived from tupiniquim, a major native-brazilian ethnic group and a slang to refer to anyone or anything that is brazilian) is a term generally used to refer to the sci-fi/Cyberpunk movement in Brazil, predominantly on the literary scene. It was originally coined in the 2000s, to describe a satirical genre that criticized the predominant US-centric and Eurocentric views of the sci-fi genre","Romantic Academia is visually and philosophically similar to Light Academia. However, Romantic Academia includes more visuals associated with romantic love and lust, the latter of which is generally excluded from Light Academia","Cubism has been considered the most influential art movement of the 20th century. Cubism is an early 20th century avant-garde art movement that revolutionized European painting and sculpture, and inspired related movements in music, literature and architecture","This genre focuses on the concept of magic being tied to the soul and the artistic interpretation of that feeling. It revolves around the concept of otherworldly magic and is heavily inspired by fantasy media created for young girls","Gothic originally started as a type of architecture starting in the 12th century Europe, with significant characteristics being pointy arches and usually applied on flying buttresses. Gothic art would eventually evolve into more than a type of outer design, with the label being applied to artwork, poems, books, fashion and eventually shows and video games","The Midwest is city, town, forest, and cornfield, Expect Detroit, that place is Midwest Gothic in a city. Midwest Gothic is a type of Regional Gothic aesthetic characterized by the portrayal of common facets of the Midwestern American lifestyle in a macabre light","Its purpose was to ridicule the meaninglessness of the modern world. Dadaism is an artistic movement in modern art that started around World War I","Anti-Fashion is an umbrella term for various styles of dress which are explicitly contrary to the fashion of the day","The Biker Aesthetic is not quite the bike itself, or anyone who rides one, but a specific type of style and attitude that is associated with it. The biker aesthetic is an image of toughness, roughness, sex appeal, and danger","Kawaii Gamer is a version of Kawaii that is popular amongst gamers, Twitch streamers, and anime fans, particularly ones who use TikTok and are Gen Z. While the aesthetic requires a large quantity of merchandise (as maximalism is common), it is more accessible and casual than J-Fashions that were more popular in the past due to the rise of Kawaii culture globally and commercialization","Heavy Metal was the culmination of the Acid rock heard in the late 1960s - a genre that describes the heavier sounding Psychedelic rock first played by various bands of the San Francisco music scene. Metal is a term that encompasses a style of heavy, aggressive music","Overall, it is fairly similar to Dark Academia, but with a more Punk approach to life. It tends to value freedom of information and equality in learning and the rest of life","Unlike its original subculture which had its origins in Gothic Rock, Mall goths could often be found listening to Nu-Metal, Industrial Metal and Marilyn Manson.\"Mall goth\" is derived from the words \"mall\" and \"goth\", referencing how many participants of the subculture would often spend time at shopping malls. Mall goths (also known colloquially as \"spooky kids\"), originally a term used as an insult, is a term used to describe a subculture (subculture used very debatably here) of \"wannabe Goths\" in the '90s-early 2000s who would try to imitate the goth style without actually knowing anything about the goth subculture beyond wanting to look the part"," As it is primarily a visual style, it's impossible to pin down visual kei by hearing alone, and to dismiss a band as \"not visual kei\" based on their sound is unwise, as the music can range from J-pop to extreme metal to electronic dance music. Determining whether a band is visual kei or not is generally rather easy - it can be as simple as looking at images of the band, and either the fans or the artists themselves will be sure to let you know if they are, as it's generally a conscious choice to be a part of the scene","Rainbowcore is an aesthetic that has a focus on rainbows","Art Deco is a twentieth century aesthetic that emerged after World War 1. It flourished in the 1920s, 1930s, and 1940s, before becoming less popular after World War Two ended","Heistcore aesthetics can be found in espionage, crime, and detective media. The title Gentleman Thief is sometimes applied to males who participate in heists, especially in media set during the Golden Age of Detective Fiction","Works that fall under this category tend to explore the themes of class, industrialism, and feature English staples such as cheap tea and biscuits. Other common themes are the hardships of labour occupations such as coal or steel mining and factory work that are common among those in the working class in England","Comiccore does not concern superheroes, which dominate the industry to the extent they constitute an entirely separate aesthetic, or Manga, which is thematically and visually as far removed from Western comics as Anime is from Western cartoons. Unlike Pop Art, which can sometimes include comic elements (as in the case of Roy Lichtenstein's famous piece Whaam) comiccore is less self-referential and deconstructive, instead referring to the inherent and unique properties of comics themselves","The fusion of cyberculture and the psychedelic subculture into a new counterculture of the 1980s and 1990s. Cyberdelic (now known as Virtualcore) is a term used to the immersion in cyberspace as a psychedelic experience","Brocore (or bro culture) is a subculture of young men who spend time partying with others like themselves","Luminism preceded impressionism, and the artists who painted in a luminist style were in no way influenced by Impressionism.As defined by art historian Barbara Novak, luminist artworks tend to stress the horizontal, and demonstrate the artist's close control of structure, tone, and light. It is characterized by effects of light in the landscape, through the use of aerial perspective and the concealment of visible brushstrokes","Similar to Vaporwave and Seapunk, this aesthetic is an integral part of the genre and characterizes the artists who dive into the Slimepunk movement. Slimepunk music often times features heavy &amp; distorted bass-lines and has emerged largely from a post-acid scene","It has had a widespread influence, ranging from the arts to lifestyle.As an art movement, minimalism began in post-WWII Western art, and was most prominent in the 1960s through the early 1970s. Minimalism refers to a lack of clutter or unnecessary detail","This involves specializations such as oceanography, marine biology, marine archaeology, ocean engineering, hydrology, naval architecture, etc.This aesthetic mainly centers around one's passion for learning about the deep ocean, sea mythology, marine life, and mysteries of the abyss. Ocean Academia is an Academia aesthetic that revolves around the fascination, dark understanding, and scientific pursuit of marine education","But the unique and iconic visual aesthetic cultivated alongside it is now, debatably, more popular and recognizable than the music itself. Vaporwave is a music genre branching from electronic Chillwave","","The name comes from the French slang word sape, which means \"clothes\" or \"dressed up.\" La Sape aims to show elegance and style within fashion, similar to predecessors before. La Sape (also known as The Society of Ambianceurs and Elegant People) is a subculture centered on the cities of Kinshasa and Brazzaville in the Democratic Republic of the Congo and Republic of Congo respectively","This aesthetic does not aim to romanticize, fetishize, or glorify illness or medical-related trauma but aims to act as a coping mechanism for those in need of it. If these sort of things bother you please leave this page.Medicalcore is an aesthetic that involves paraphernalia and the appearance of all things medical-related","Vintage Parisian is a feminine aesthetic that takes influence from mid-twentieth century Paris and similar cities like New York and London, luxury brands, and old Hollywood movies. This aesthetic was embodied by the original films, advertisements, and brands, and was later collected into moodboards and blogs by women on tumblr, and later tiktok","The name is a reference to the 1975 James Caan film Rollerball, and like the film, the aesthetic often delves into 1970s retrofuturism, however, unlike standard Retro-Futurism or Atompunk, Rollerwave deals only with the 70s, and has a far less Jetson-y feel. Rollerwave is an aesthetic which does for the 70s what Outrun does for the 80s and Vaporwave does for the 90s","Arts and Crafts movement was a worldwide aesthetics and fine arts movement that originated in the United Kingdom and expanded across the rest of Europe as well as America. Economic and social improvement were the goals of the arts and crafts movement"," If you don't think this qualifies as an eam fashion sensibility, wearing vintage and thrift store-bought clothing; hold pacifist and green views; are often vegan; consume organic and artisanal foods, and craft alcoholic beverages; and live alternative lifestyles","Nautical is an aesthetic centered around sailing and living near the sea","Seapunk is a music and visual art genre that utilize imagery from the 2000\u2019s Cyberpunk culture, including dolphins, pyramids, bright colors, beach scenes, and dreamscapes. Seapunk was extremely popular in the late 2000s and early 2010s until it started to get mainstream too quickly (being utilized by the likes of Lady Gaga and Katy Perry), culminating in the infamous (to the scene) Rihanna performance on Saturday Night Live of her hit song \"Diamonds\", which co-opted a lot of Seapunk imagery and aesthetics during it"," Subgenres for royalcore may have page extensions listed below their descriptions.   Royalcore, as of now, mainly focuses on visual characteristics and contexts of historical European monarchies","Pale or Pale Aesthetic is an aesthetic based on simple photos with a color palette based on white, grey, black, green, and blue. The type of media they consumed was also incredibly specific, with fangirl culture and this aesthetic often overlapping","Zentai is a type of fashion that is a skin-tight garment that covers the entire body, they come in many styles, colors, and designs.  Originating in Japan, this form-fitting outfit has been used around the world for a variety of activities; marketing/advertising, film, sporting events, street dancing, and performance art (just to name a few)","on the internet. This is about creepy things on the internet, the dark web, and the overall mysterious and creepy content of the internet"," If this sort of content bothers you, please feel free to leave this page and check out another one. Content warning: This page may contain sexually suggestive material","The media itself does not have to be set in this time period, but es around things of a sexually explicit nature such as hentai, sex talk, and vulgar music lyrics (including the N-slur). Also, drug talk will be mentioned","Caninecore by itself is a very flexible aesthetic, the only requirement for caninecore is canines. Caninecore is an aesthetic based on canines","The Dark Paradise aesthetic focuses on images of serenity with a veil of darkness laid over it to rouse a sense of dark calmness. Dark Paradise revolves around visually dark photos, as if taken in the dark or in the late evening","Princesscore is an aesthetic based on the life, fashion, and mannerisms of a princess","Softie is a group of aesthetics dedicated to going for as cutesy of a look as possible, putting it in a trifecta of aesthetics, alongside VSCO and E-People. It draws a lot of parallels with some of the Kawaii-centric aesthetics in Japan, but with a more subdued look compared to how over-the-top some of the looks in Japan tend to get.They are sometimes mistaken for preppies","The term 'Twee', defined as a British term meaning \"affectedly or excessively dainty, delicate, cute, or quaint\", is the baby-talk mispronunciation of sweet and is seen in the lexicon as early as 1905","","While it faded out of fashion in the 1970s, it has enjoyed occasional blips of popularity since the 1990s. The word 'hippie' came from the word 'hipster' and was used to describe beatniks who moved into New York City's Greenwich Village and San Francisco's Haight-Ashbury district","Sharpie gangs were frequently named after the suburb or street the gang members came from. Sharpies, (or Sharps, not to be confused with SHARP (Skinheads Against Racial Prejudice)) were members of suburban youth gangs in Australia, most significantly from the 1960s and 1970s"," The aesthetic of ghostcore is described as \"dark, haunted, and ethereal-like landscapes, cemeteries, the spiritual world and connecting to it, haunted artifacts, dark and mysterious history, legends and ghost stories, and more\" according to a private Ghostcore Facebook page. Ghostcore is an aesthetic revolving around ghosts, spirits, cemeteries, and the eerie feeling surrounding them","Christian girl autumn is an over-the-top, specific version of the Autumn aesthetic. It features many elements of the Autumn aesthetic and is often associated with basic white girls","The style was most popular in the mid-to-late 1980s and early 1990s (usually around the period late 1985 to 1991 at the peak of its popularity). Bodikon (\u30dc\u30c7\u30a3\u30b3\u30f3), or often referred to as \u201cBubble Queen\u201d style post-Bubble, is a style and increasingly a general aesthetic, that was centered around the distinctive style of dress by the same name, the bodycon, (of which its name is a shortening of the pronunciation of the English words \"body conscious\"), but was not entirely based around the dress, and would come to include the general female fashion of the Bubble Economy period","In a post describing Steelpunk on the SFFWorld website it is characterised as being \"about hardware, not software, the real world not the virtual world, megatechology not nanotechnology. The artefacts of Steelpunk aren\u2019t grown, printed or programmed, they\u2019re built","Pretentiousness is celebrated within the dark academia community. Characters within the works of fiction associated with Dark Academia, specifically The Secret History and Kill Your Darlings, live decadent and self-destructive lifestyles involving drugs, moments of intense violence and secrets.People who use this aesthetic are usually referred to as dark academics","Chaotic Academia is an aesthetic that involves haphazard routines, messy habits, unusual or banned literature, and studying with a passion","","1950s Suburbia describes the culture of the American middle class in the 1950s. The most famous example is Levittown, in New York state, which was the prototype for mass produced, mass-scale housing.The government led push for a return to normalcy rend found on sites like Tumblr and Instagram, sizz is in fact a more modern evolution of several older aesthetics - a sort of combination of the German expressionist method of abstraction to build a sense of mood, the emotion created by contrast and lighting in American film noir, and the way the Japanese are-bure-bokeh street photography movement embraces griminess and lack of focus in its snapshots. Sizz is a relatively new aesthetic that focuses on noise, distortion and other artifacts as a way to modify the subject of an image and make it more abstract"," Some members of white nationalist movements have attempted to co-opt these symbols to promote their own hateful ideology, but the Northerness aesthetic has absolutely no interest in promoting a white nationalist ideology and would instead like to reclaim those symbols as sacred to the Nordic people as opposed to something used to promote hate (especially considering, for their time, the Viking people were actually an incredibly progressive society). Northerness is an aesthetic related to Nordic/Scandinavian areas of the world","They were not part of the image of the American Pioneer that existed in the 19th Century and little attention is given to them in both historical fiction and American History lessons.) Pioneers were motivated by Manifest Destiny, a concept within American culture that claims that God has ordered the American people to make the nation occupied from the Atlantic to the Pacific. For the most part these people were white, and either Americans from the East Coast or European immigrants","It is based around the dismal, muted earthy colours and themes of the desert. Desertwave is an aesthetic based off and around the desert and desert styled motifs","The plots revolve around upper class characters and murder. It centers around the dichotomy between the elegance of the European elite and the savagery and blood that comes with the events of the story","Southern Gothic is a goth subgenre encompassing fashion inspired by Southern outfits, locations from the 1800s, and literary works. It originated in works by 19th-20th century Southern authors criticizing their society's racism, sexism, classism, fixation on the past, and decaying economy","Probably the most popular example of Afrofuturism in popular culture right now is Black Panther. Afrofuturism is an aesthetic centered around an Afrocentric view of the future (it shares some similarity to Solarpunk [which is something of a misnomer itself since Solarpunk is a less dystopian worldview compared to Cyberpunk]) and buys into the philosophy that the future is black","'kin can't have fun with their identities, nor that people shouldn't voluntarily take on an identity for any reason, though it's good to be aware of this distinction and the possible spread of misinformation.There are a few different ways in which 'kin/related identities can develop. While neither of these things are bad on their own, the misuse of otherkin terms has harmed the community through misunderstandings, and the devaluing of spiritual/psychological 'kin's experiences.There is an important distinction to be made between spiritual/psych","Light Academia is an academic aesthetic and the visually lighter counterpart of Dark Academia. Haussmann-era Paris and images of domesticity also differentiate Light from Dark Academia","This aesthetic often appeals to introverted people. Rainy Day is based on rainy weather, as well as stormy or foggy weather","The people who participate in this aesthetic are unlikely to be aware of the aesthetic community as a whole. Visually, the aesthetic shares many traits with Western, but there is no emphasis on the 19th century, adventure or lawlessness, and instead focuses on the idea of home and being settled within the farmer lifestyle","Dark Nautical is a subgroup of the Nautical aesthetic. Whereas Nautical tends to focus on much more higher economic class aesthetics and Pirate on chaotic, Dark Nautical centers around a more simple and harmonized life like cottagecore","The visual of the aesthetic applied to digital drawings of a lowish quality or made with tools the program of the same name has. MS Paint is a subgenre of old web","It incorporates many elements of Camp and Kitsch; it is a total subversion of what is deemed to be good taste in contemporary American society, as it openly celebrates identities that are shamed in American society: the poor, drag queens, sex workers and the kink scene, and rural \"uncultured\" communities. Mature Content and Trigger Warning: The article mentions sexual motifs and gun violence.This page is under construction","This page needs work.Sloanie, Sloane or Sloane Ranger is a stereotypical young upper-middle or upper class British person who pursues a distinctive fashionable lifestyle. Sometimes these people are referred to as \"Posh\" but it is important to note that not all posh people are Sloanes","Various City Pop songs are sampled in many Future Funk songs. Famous City Pop artists include, Mariya Takeuchi, Taeko Onuki, Miki Matsubara, Anri, Naoko Gushima, Tatsuro Yamashita, Junko Yagami, etc.There are many City Pop compilations on YouTube for people to listen to, with channels such as Ganymede Cafe making 40 minute long compilations of City Pop songs","Hallyu (also known as the Korea Wave) is an aesthetic heavy centered around South Korean popular culture; especially Korean pop music (commonly referred to as \"K-Pop\") and Korean drama shows (commonly referred to as \"K-Dramas\")","It can also be a reference to Summer fashion styles.It is widely considered the favorite season of many, considering that it is the vacation period of schools and many adults, attributing it a more carefree, cheerful and high-energy spirit. Summer is the hottest season of the year and an aesthetic that involves the season of the same name","Notice: While a couple of artists in this aesthetic are extremely political, both in beliefs and in the music, the Aesthetics Wiki does not endorse or condone these beliefs. Any artists listed here are here purely for archival and education purposes only.Dungeon Synth is a subgenre of dark ambient music that emerged in the late 1980s and early 1990s","Not to be confused with the Playboy brand, often associated with the Bad Bitch aesthetic.The Playboy aesthetic revolves around the aesthetics of the jet-setting playboy lifestyle. It could be viewed as a Brocore colored variant on the Boujee aesthetic with it's own unique tone and spin on things","Karasu Zoku was a japanese movement during the 1980s that consisted of wearing all-black designer outfits","","Magewave is an aesthetic associated with the classic ideal of the wizard. It shouldn't be confused with Wizardcore or Witchcore, as it rejects the muted imagery and Cottagecore stylings associated with those aesthetics","The aesthetic concept is popular within the gay community because of gay men being perceived by mainstream society as less masculine and worthy of ostracization. For example, drag shows, the gay \"accent,\" and cult films popular within the LGBT community such as The Rocky Horror Picture Show are examples of camp.Defined by Merriam Webster: \"Absurdly exaggerated, artificial, or affected in a usually humorous way.\" This Definition gives the \"Campy\" aesthetic an incredibly wide reach, while still fitting within the genre","","It is important to note that Progressive Academia should not considered a pure subset of the larger Academia family, but more a deconstructed version of it, influenced by the Commonwealth movements for progressive university education and mid to late-1900s architectures. Progressive Academia (otherwise known as progressive traditionalism) is an aesthetic and academic philosophy based upon the style of academic delivery and collegiality at \u201cmodern\u201d urban universities, especially those of the Commonwealth","It is a specific genre of philosophy, expressing itself in literature, architecture, art, and music, which has Ancient Greek and Roman sources and an emphasis on society.In some situations, classicism can be politicized by white nationalists with the intention of creating an impression of \"Western culture\" from many diverse cultures. This can then be portrayed as \"what we [the white race] are protecting,\" an ahistorical medley of very different \"white\" cultures","Themed around softer aspects of hoarding, collecting, cooking, and other goblincore essentials, focuses on the softer curiosity rather than the goblin-ey nature. Pigeoncore is an aesthetic surrounding the theme or hoarding and nature but includes that of birds (most notably, pigeons)","For the art and architecture movement associated with the era, see Art Deco. The Roaring 20s is the given name to the decade of the 1920s in Western culture","The story may involve attempts to prevent an apocalypse event, deal with the impact and consequences of the event itself, or may be post-apocalyptic, and be set after the event. The apocalypse event may be climatic, such as runaway climate change; natural, such as an impact event; man-made, such as nuclear holocaust; medical, such as a plague or virus, whether natural or man-made; or imaginative, such as zombie apocalypse or alien invasion","Gothcore is an aesthetic that involves the themes and characteristics of the goth aesthetic with the metalcore aesthetic dashed in. Gothcore is a fusion of gothic rock (or gothic metal) and hardcore punk (or metalcore)","The Club aesthetic is centered around entertainment venues and bars that usually operate late into the night","Typically these are abandoned, and oftentimes empty - a mall at 4am or a school hallway during summer, for example. The aesthetic known as a Liminal Space is a location which is a transition between two other locations, or states of being","It is similar to Light Academia and Dark Academia in its value of studying, dedicated practice of learned interests, 18-19th century-inspired aesthetics, and architecture, but is unique in focusing primarily on the visual arts. Art Academia is an Academic aesthetic centered around the creation and enjoyment of art, including sculpture, painting, sketch, doodling, photography, and calligraphy","Ocean Grunge is a music-centric aesthetic that is considered the darker version of Seapunk that started in 2014. The music itself takes a lot of inspiration from early Vaporwave, drone, Nu-Metal, and Grunge, and does have some similarities to Witch House, but while Witch House has more of a spooky and ethereal air to it, Ocean Grunge tends to be hollow and depressing but still carries the ocean/sea motif its cousin genre carries","The aesthetic also holds onto a degree of melancholy, tying back into its original creation for the Neurodivergent community and the stigma/misunderstanding that often comes with it. Changelingcore is an aesthetic that borrows ideas from Goblincore, holding the same idea of mischief, as well as loving the parts of nature that are shunned by others","","Lovecore tends to focus on the commercialization of love through Valentine's Day and marketing as well as wholesome celebration of love rather than the dark, macabre or erotic. There is sometimes overlap with anime in the form of pink manga edits and images of anime characters with hearts in their eyes.As the aesthetic became more intense and anime-centric, a subcategory of lovecore called Yandere appeared","The term derived from the unrelated \"French New Wave\" and was originally used as a catch-all for the music that emerged after Punk Rock, including punk itself, but may be viewed retrospectively as a less challenging counterpart of Post-Punk. Although new wave shared punk's DIY-philosophy, the artists were more influenced by the lighter strains of 1960s pop while opposed to mainstream \"Corporate\" rock, which they considered creatively stagnant, and the generally abrasive and political bents of punk rock","Metalcore (or metallic hardcore) is a fusion music genre that combines elements of extreme metal and hardcore punk together. Among other styles blending metal and hardcore, such as crust punk and grindcore, metalcore is noted for its use of breakdowns, which are slow, intense passages conducive to moshing","Bohemian (also known as boho-chic) is a style of fashion drawing on various bohemian and hippie influences, which, at its height in late 2005 was associated particularly with actress Sienna Millerand model Kate Moss in the United Kingdom and (as \"boho\" chic) actress and businesswoman Mary-Kate Olsen in the United States.  It is a style of fashion drawing on various bohemian and hippie influences","","The tanned skin, big hair, and rebellious outfits went highly against the traditional Japanese beauty standards. Gyaru (\u30ae\u30e3\u30eb) is one of the oldest Japanese fashions that still exists today","Kid Science is the aesthetic surrounding educational efforts to make science appealing to children through presenting the field as fun, with kooky characters, bright colors, highly stylized images, and doable experiments. Unfortunately, many of the efforts into kid science are marketed towards boys, but the subject is gender-neutral.It emphasizes all fields, but paleontology, zoology, entomology, and astronomy are the most popular subjects","Spiritcore is an aesthetic primarily based around the feeling of supernatural or out of this world happenings at night. It is often associated with a feeling of loneliness, but this is not necessarily a bad thing"," Thank you.Stripcore is an aesthetic inspired by a romanticized vision of strip clubs and other such establishments.  If this sort of content bothers you, please feel free to leave this page and check out another one","The prefix comes from the word con, which is short for \u201cconfidence trick.\u201d The core element of a con is convincing people that someone or something is other what it is in reality and is usually done for monetary gain. Concore is an aesthetic associated with thieves, conmen, grifters, lifters, and scammers","The term is used with both positive and negative connotations, as it can be a goal for many yet offensive to many more, as people who are overwhelmingly wealthy are often blind to the struggles of those without such wealth and opportunity.  Boujee people are concerned with wealth, status, and all thing luxury","The Angelcore aesthetic is not always explicitly religious and sometimes involves sacrilege. Users of these aesthetic are not necessarily religious","wearing glasses, a bowtie, overalls, high socks, slacks, and/or braces). The term \"nerd\" originated in the 1950s from a Dr","The trend was relatively dormant until March 2015, when tumblr user korvidian created a post entitled \"south-east queensland gothic\" that created the template for all future Regional Gothic lists here on after. Regional Gothic is a tumblr trend in the mid 2010s wherein users would write bullet-pointed lists of eerie moments related to the region in which they grew up in or other seemingly benign moments in life, such as college","Vikings were 8-11th century Norse seafarers from Southern Scandinavia. However this may just place them higher on the cleanliness scale than Anglo-saxons, but not as clean as 10th century Muslims","Raves are an organized dance party at a nightclub, outdoor festival, warehouse, or other private property typically featuring performances by DJs, playing a seamless flow of electronic dance music. DJs at rave events play electronic dance music on vinyl, CDs, and digital audio from a wide variety of genres, including techno, hardcore, house, bassline, dubstep, New Beat, and post-industrial","The term was made popular by Quentin Tarantino and Robert Rodriguez with their 2007 collaborative double feature, Grindhouse, which attempts to capture the essence of sitting in a Grindhouse movie theater, complete with previews and interludes. Grindhouse is an aesthetic originating in the 1970s involving the poor living conditions of ghettoes, cheap, low-budget genre films, and decaying urban sprawl","By 2012\u201313, the skeuomorphic look of Frutiger Aero (i.e. Frutiger Aero is an aesthetic that was prevalent from roughly 2004 to 2012","In addition to aesthetic images, much of this information comes from memes, whisper confessions, and text posts of things happening within their personal lives.  What distinguishes this aesthetic from the previous aesthetics above is the persona of these bloggers","Maidcore is an aesthetic based around maid outfits and things in media related to maids.  The aesthetic is mostly based around the common outfits and activities of a maid, but does change depending of the type of person","The Military aesthetic is based on war and other aspects of military life","It is part of Anti-Kawaii which adds opposing elements to typical the kawaii style in order to leave a greater impact. Also, keep in mind that this shouldn't be used as just a cutesy aesthetic.Yami Kawaii (\u75c5\u307f\u304b\u308f\u3044\u3044) is a Japanese aesthetic that was derived from Yume Kawaii with a stronger emphasis on dark themes and colors","Many modern businesses also try to capitalize on the novelty and clutter the restaurant with paraphernalia that reminds the diners of the 1950s. Diner is an aesthetic focused around the architectural design of vintage American diners, usually from the 1950s","This page will talk a lot of heavy drug usage and, as a result, some particularly dark topics will come up. Viewer discretion is advised.Drugcore is an aesthetic centered completely around drug usage and what some people will do to chase that specific high","Because Romanticism is so idealistic, it often aligns itself with Nationalism which is why the traits and visual tropes of Romanticism vary from country to country. However, this fascination with national ideals often resulted in a Romantic fertilization of non-western/European societies and cultures","\t\t \t  \t \t \t \t\t \t\t \t\t \t\t\tA longer hairstyle. \t\t \t  \t \t \t \t\t \t\t \t\t \t\t\tA classic hair-do","Bardcore (also known as Tavernwave) is a music genre that arranges modern pop-songs such as \"What is Love\", \"Pumped up Kicks\" or \"Astronomia\" to sound medieval and \"old-timey\"","The aesthetics that revolve around Spring are centered around motifs such as budding flowers and meadows, baby animals, sunshine, and a \"fresh\" and \"new\" feeling. Spring is an aesthetic that is focused around the season of the same name, At this time of year, with the melting of the Winter snow, farmers begin to sow seed, while others plant flowers","Glowwave is an aesthetic surrounding the theme of things that glow in the dark or with assistance from a UV light (also commonly called a blacklight) or with the glow of neon lights and bright, neon colors","While it is particularly regarded as a musical genre, there are examples of synthwave in movies, TV shows, art, and video games. The music strongly shares some key traits within the French House/Italo Disco musical genres","Goblincore is an aesthetic based on the appreciation of aspects of nature not typically regarded as beautiful. These aspects can range from animals such as frogs and snails to materials such as moss, mud, plants, and fungi such as mushrooms","The Medieval period, also called The Middle Ages, is an era that lasted from the fall of the Roman Empire to the start of the Renaissance, which occurred from approximately the 5th century to the 15th century. Between this time, there were multiple advancements in art and architecture, but due to popular perception of the era, recurring motifs, and difficulties in periodization, this page will encompass a survey of the entire artistic history","Horror Academia is a subgenre of academia that focuses thematically on the overwhelming amount of knowledge in the world. Horror academia is a dreary, depressing aesthetic that reflects the difficulty and laborious workload of real academia, made manifest in the spooky, grimdark, and monstrous horror ambience of the aesthetic","Please read The American Revolutionary War and its preludes is a period of history from 1765-1783 in the Thirteen Colonies that established the nation of the United States of America by overthrowing the British Crown. Note: Because we are a wiki for aesthetics, the history of the American Revolution will not be explored in-depth","\"Normcore\" is a portmanteau of the words \"normal\" and \"hardcore\". The word first appeared in webcomic Templar, Arizona before 2009 and was later employed by K-Hole, a trend forecasting group, in an October 2013 report called \"Youth Mode: A Report on Freedom\".As used by K-Hole, \"normcore\" refers to an attitude, not a particular code of dress","","","The Gathering of the Juggalos, alternatively known as just \"The Gathering\", is a notable annual festival held by Juggalos and the artists that they support, which have included rap stars such as Busta Rhymes, Ice Cube, and MC Hammer; over its first eleven events, the festival had an average attendance of about 10,000 fans, with a peak of 20,000 in 2010. Juggalos have developed their own idioms, slang, and characteristics","Breakcore is characterized by the usage of heavy kick drums, deep bass, odd time signatures, \"scattered breaks\" put in a random rhythmic fashion, and samples of popular songs to classical music played at high tempos (180-190 BPM). Breakcore is a genre of music born from a mixture of hardcore, gabber, IDM, jungle, digital hardcore, hardcore punk, grindcore, and industrial","","Hauntology is a genre or loose category of music and art that aims to evoke deep cultural memory, concerning itself with aesthetics of the past","Many Lolitas suspect that a writer decided the Spanish name Lolita complemented the feminine and whimsical fashion and it just caught on. Lolita dresses are categorized as either JSKs or OPs","New Age is an aesthetic intended to create artistic inspiration, relaxation, and optimism. It is used by listeners for yoga, massage, meditation, reading as a method of stress management to bring about a state of ecstasy rather than trance, or to create a peaceful atmosphere in their home or other environments, and is associated with environmentalism and New Age spirituality"]},"selected":{"id":"4934"},"selection_policy":{"id":"4933"}},"id":"4789","type":"ColumnDataSource"},{"attributes":{},"id":"4894","type":"LinearScale"},{"attributes":{"source":{"id":"4793"}},"id":"4795","type":"CDSView"},{"attributes":{"coordinates":null,"group":null},"id":"4831","type":"Title"},{"attributes":{},"id":"4843","type":"PanTool"},{"attributes":{},"id":"4830","type":"LinearScale"},{"attributes":{"active_scroll":{"id":"4779"},"tools":[{"id":"4777"},{"id":"4778"},{"id":"4779"},{"id":"4780"},{"id":"4781"}]},"id":"4782","type":"Toolbar"},{"attributes":{},"id":"4895","type":"LinearScale"},{"attributes":{},"id":"4933","type":"UnionRenderers"},{"attributes":{"tabs":[{"id":"4900"},{"id":"4835"}]},"id":"4902","type":"Tabs"}],"root_ids":["4902"]},"title":"Bokeh Application","version":"2.4.1"}}
